INSERT INTO `accounts_entity` VALUES (184,'local',0,40.416887,-3.703549,'','',2015,'','13 SIGNOS S. COOP. MAD.','13 Signos',5,2,'Prestar los servicios necesarios para facilitar la igualdad en el acceso a la información y la comunicación entre personas con o sin discapacidad sensorial. Siendo un agente más en la normalización lingüística de las lenguas de signos española.',NULL,NULL,10,'Prestar los servicios necesarios para facilitar la igualdad en el acceso a la información y la comunicación entre personas con o sin discapacidad sensorial. Siendo un agente más en la normalización lingüística de las lenguas de signos española.',NULL,NULL,'http://www.13signos.es','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'','Acacias 3, 1º A'),(185,'local',0,40.4256439732,-3.70880976319,'entities/6f68fbdd-6c0a-45ac-84a5-29e574fd8619.jpg','',2016,'','2decologico S. COOP. mad','2decologico. Tienda ecológica y grupos de consumo',2,3,'<p><strong>2D</strong>&nbsp;es un&nbsp;<strong>proyecto cooperativo</strong>&nbsp;que nace de la necesidad de poner en contacto a peque&ntilde;xs productorxs locales y a consumidorxs responsables de Madrid Centro, con la intenci&oacute;n de crear una&nbsp;<strong>comunidad de personas</strong>&nbsp;que favorezcan los circuitos cortos de comercializaci&oacute;n de productos ecol&oacute;gicos de proximidad.</p>\r\n\r\n<p>Nuestra cooperativa de consumo se remontan a septiembre de 2014, cuando comenzamos a desarrollar la idea de crear un<strong>&nbsp;grupo de consumo gestionado</strong>&nbsp;donde las labores de administraci&oacute;n, organizaci&oacute;n y funcionamiento fueran realizadas por personas fijas y no se rotasen en las mismas como en los grupos de consumo autogestionados. Tras dos a&ntilde;os desarrollando el proyecto en un peque&ntilde;o local en la calle 2 de Mayo, en octubre de 2016 dimos el salto natural hacia un local m&aacute;s grande situado en la calle<strong>&nbsp;Noviciado 9,&nbsp;</strong>con dos l&iacute;neas de negocio m&aacute;s:&nbsp;<strong>nuestro local donde encontrar productos ecol&oacute;gicos de calidad y la formaci&oacute;n en consumo responsable</strong>.</p>\r\n\r\n<p>Facilitamos&nbsp;<strong>productos ecol&oacute;gicos de proximidad</strong>. Garantizamos el&nbsp;<strong>origen</strong>&nbsp;de los productos para asegurar su&nbsp;<strong>calidad</strong>&nbsp;y c&oacute;mo se&nbsp;<strong>producen,</strong>&nbsp;para provocar el&nbsp;<strong>menor impacto medioambiental</strong>&nbsp;posible. Fijamos el&nbsp;<strong>precio digno</strong>&nbsp;para cada producto, aquel que permite al productor la reproducci&oacute;n de la vida y al consumidor poder conseguirlo, valorarlo y disfrutarlo.</p>\r\n\r\n<p><span style=\"background-color:#f1c40f\">Nuestro plan de futuro</span>: en el momento actual estamos en el periodo de transici&oacute;n (entre 8 y 10 meses) para dar el salto al supermercado cooperativo La Osa. Es decir, estamos trabajando intensamente en convertir 2D en <a href=\"http://cooperativalaosa.com\"><strong>La Osa</strong></a>, tu <strong>supermercado cooperativo y participativo de Madrid</strong>. Un espacio de 800m&sup2; en el que encontrar <strong>productos asequibles y de calidad</strong>. Mantenemos los mismos valores de cooperaci&oacute;n y participaci&oacute;n, haciendo accesible una alimentaci&oacute;n ecol&oacute;gica y responsable.</p>','https://www.facebook.com/2decologico/?fref=ts',NULL,100,'Tienda de productos ecológicos locales y gestión de grupos de consumo',NULL,'https://twitter.com/2decologico','http://2decologico.org/','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'','C/ Noviciado 9, local 9'),(186,'local',0,40.3848583796,-3.65759968758,'entities/51c3da42-d5fc-48e2-ba2b-c6b268cfb86c.jpg','',2002,'','ABIERTO HASTA EL AMANECER S.COOP.MAD','ABIERTO HASTA EL AMANECER S.COOP.MAD',2,3,'<p>Desarrollamos de programas y acciones formativas para la educaci&oacute;n en la participaci&oacute;n social y promoci&oacute;n de h&aacute;bitos de vida saludable.&nbsp;</p>','https://www.facebook.com/AbiertoMadrid/',NULL,50,'Desarrollamos de programas y acciones formativas para la educación en la participación social y promoción de hábitos de vida saludable',NULL,'https://twitter.com/cooperativa_aha','http://www.abiertomadrid.coop','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'','Calle Puerto de Viñamala 15'),(187,'local',0,40.416887,-3.703549,'','',2014,NULL,'AQUO S. COOP. MAD','AQUO S. COOP. MAD',2,3,'SERVICIOS JURIDICOS, ASESORAMIENTO FISCAL LABORAL CONTABLE. ESPECIALIZADOS EN ENTIDADES DE LA ECONOMIA SOCIAL.',NULL,NULL,10,'SERVICIOS JURIDICOS, ASESORAMIENTO FISCAL LABORAL CONTABLE. ESPECIALIZADOS EN ENTIDADES DE LA ECONOMIA SOCIAL.',NULL,NULL,NULL,'','',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,'CALLE COVARRUBIAS 22 3D'),(188,'local',0,40.416887,-3.703549,'','',2013,NULL,'ARCADUZ CERAMICA','ARCADUZ CERAMICA',2,8,'diseño,elaboración y venta de productos cerámicos Formacion e investigacion del proceso ceramico',NULL,NULL,10,'diseño,elaboración y venta de productos cerámicos Formacion e investigacion del proceso ceramico',NULL,NULL,'http://www.arcaduzceramica.es','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'a determinar','Hermanos del moral 13'),(189,'local',0,40.470751,-3.698935,'entities/a9f08727-7e51-480d-a567-84ed3c643205.jpg','',2018,'','ATO2 Consultoría / servicios de accesibilidad universal','ATO2 Consultoría / servicios de accesibilidad universal',5,3,'<p>Disponemos de&nbsp;dos bloques:</p>\r\n\r\n<p>1. Tienda online donde se vende material de rehabilitaci&oacute;n cognitiva, sensorial y f&iacute;sica, as&iacute; como productos destinados a facilitar la realizaci&oacute;n de las actividades de la vida diaria (alimentaci&oacute;n, aseo, etc.).</p>\r\n\r\n<p>2. Ofrecemos una serie de servicios destinados a la inclusi&oacute;n de las personas con diversidad funcional o personas con discapacidad. Nuestros servicios son los siguientes:</p>\r\n\r\n<ul>\r\n	<li>Adaptaci&oacute;n de entornos (hogar, centro de trabajo, parques infantiles...)</li>\r\n	<li>Adaptaci&oacute;n de puestos de trabajo</li>\r\n	<li>Impresi&oacute;n 3D</li>\r\n	<li>Asesoramiento a otras entidades s&oacute;bre c&oacute;mo ser m&aacute;s amigable con las personas con diversidad funcional y personas mayores</li>\r\n	<li>Desarrollo de proyectos para fomentar la inclusi&oacute;n de las personas con discapacidad a trav&eacute;s del deporte, empleo, formaci&oacute;n, ocio...</li>\r\n</ul>','https://www.facebook.com/ato2info/','https://instagram.com/ato2_terapiaocupacional',100,'Venta de material de rehabilitación, productos de apoyo y material ortoprotésico y creación de proyectos para conseguir la inclusión de las personas con discapacidad en la sociedad; tb adaptamos puestos de trabajo, viviendas, 3D y asesoramos.',NULL,'https://twitter.com/ato2_info','https://atodos.es/','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'','Calle Álvarez 8'),(190,'local',0,40.416887,-3.703549,'','',2009,NULL,'Adeia Copp','Adeia',2,3,'Servicios jurídicos, consultoría, gestoría, formación y proyectos.',NULL,NULL,10,'Servicios jurídicos, consultoría, gestoría, formación y proyectos.',NULL,NULL,'http://www.adeia.es','','',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,'c/ Conde de Xiquena, número 9, 2º izquierda'),(191,'local',0,40.416887,-3.703549,'','',2009,'','Agresta S. Coop','Agresta s. coop',2,3,'Ingeniería del Medio Natural. Biomasa.',NULL,NULL,10,'Ingeniería del Medio Natural. Biomasa.',NULL,NULL,'http://www.agresta.org','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'','c/ Duque de Fernán Núñez, 2, 1º'),(192,'local',0,40.4046486778,-3.70379805565,'entities/82774975-f55a-4bc2-b812-740860555ea8.jpg','',2008,NULL,'Altekio, iniciativas hacia la sostenibilidad','Altekio',5,3,'<p>Facilitamos procesos de cambio en personas, organizaciones y territorios.</p>\r\n\r\n<ul>\r\n	<li>Desarrollo organizacional y facilitaci&oacute;n de grupos</li>\r\n	<li>Innovaci&oacute;n social, gobernanza y participaci&oacute;n ciudadana</li>\r\n	<li>Resiliencia territorial y regeneraci&oacute;n de socioecosistemas</li>\r\n	<li>Inv