ios editoriales, de dise&ntilde;o y desarrollo web.</p>','https://www.facebook.com/ElSaltoDiario/',NULL,100,'Periódico mensual de actualidad crí­tica. Servicios editoriales, de diseño y desarrollo web.','https://t.me/elsaltodiario','@elsaltodiario.com','https://www.elsaltodiario.com/','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'','Plaza Luca de Tena 13, entreplanta'),(208,'local',0,40.4257971101,-3.7091088295,'entities/cb255c70-7535-447e-8220-88c04604e5e6.jpg','',2015,NULL,'Atención Jurídica y Psicológica','Atención Jurídica y Psicológica Lugares Comunes',5,3,'<p>Atendemos y acompa&ntilde;amos a personas, parejas y familias, desde un enfoque humanista y en clave de g&eacute;nero. Ofrecemos atenci&oacute;n psicol&oacute;gica y jur&iacute;dica, y la posibilidad de combinar ambas. Tambi&eacute;n mediacion en conflictos y talleres.</p>',NULL,NULL,20,'Atendemos y acompañamos a personas, parejas y familias, desde un enfoque humanista y en clave de género. Ofrecemos atención psicológica y jurídica, y la posibilidad de combinar ambas. También mediacion en conflictos y talleres.',NULL,NULL,'http://www.lugarescomunes.org','','',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,'C/ Noviciado 20, 1 izda'),(209,'local',0,40.43182,-3.70542,'entities/e672ad77-bd45-4d0a-beb5-d4316ecfc87c.jpg','',1994,NULL,'Atlantic Group Soc. Coop. Mad','Atlantic Group S.Coop. Mad.',5,8,'<p>Ense&ntilde;anza del ingl&eacute;s.</p>\r\n\r\n<ul>\r\n	<li>General</li>\r\n	<li>Profesional</li>\r\n	<li>Preparacion de examenes</li>\r\n	<li>Conversaci&oacute;n</li>\r\n	<li>Particulares individuales y compartidas</li>\r\n	<li>Por tel&eacute;fono/Skype</li>\r\n	<li>Cursos a medida</li>\r\n</ul>\r\n\r\n<p>Traducci&oacute;n espa&ntilde;ol al ingl&eacute;s y correcci&oacute;n de textos en ingl&eacute;s.</p>','https://www.facebook.com/AtlanticGroup.Madrid?fref=ts&locale=es_ES%2F',NULL,20,'Enseñanza del inglés. Traducción español al inglés. Corrección de textos en inglés.',NULL,'https://twitter.com/AtlanticGroup1','http://www.atlanticg.com','','',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,'C/ Rodríguez San Pedro, 2, oficina 102'),(210,'local',0,40.4049999806,-3.74554395676,'entities/0484d692-e7f1-4b72-abd0-698e317e4bc5.jpg','',2016,NULL,'Baile Ocio y Cultura Popular','Baile, Ocio y Cultura Popular',10,5,'<p>Somos una promotora dirigida y gestionada por personas que aman la cultura, el baile y la m&uacute;sica. Ofrecemos servicios de&nbsp;management, producimos eventos privados, bodas, ferias,&nbsp;fiestas populares y espect&aacute;culos a medida. Tambi&eacute;n estamos detr&aacute;s de diversas fiestas que se celebran regularmente en Madrid.&nbsp;</p>\r\n\r\n<p>El trabajo de nuestros artistas y profesionales es lo que articula y da valor a nuestros proyectos. En Cultura Popular trabajan durante el a&ntilde;o unas 30 personas con distintos niveles de implicaci&oacute;n y responsabilidad. Nos guiamos por los principios de&nbsp;<strong><a href=\"http://ajuntament.barcelona.cat/economia-social-solidaria/es/que-es-la-economia-social-y-solidaria\">Econom&iacute;a Social y Solidaria</a></strong>&nbsp;y formamos parte del&nbsp;<strong><a href=\"https://madrid.mercadosocial.net/valores-y-compromisos-del-mercado-social/\">Mercado Social de Madrid</a>.&nbsp;</strong></p>\r\n\r\n<p>En Cultura Popular no hay due&ntilde;os ni &aacute;nimo de lucro. Todo lo que se genera se re-invierte en el propio proyecto y sus trabajadores. Tambi&eacute;n intentamos generar relaciones justas y &eacute;ticas: hacia &ldquo;dentro&rdquo; (socios, trabajadores, colaboradores, p&uacute;blico) y hacia &ldquo;fuera&rdquo; (salas, clientes, productoras e instituciones) mientras tejemos redes con otros proyectos y personas que funcionan en base a los mismos principios.</p>\r\n\r\n<p><strong>Imaginar, crear, &iexcl;cultura popular!&nbsp;</strong></p>','https://www.facebook.com/culturapopular.or',NULL,25,'Somos una productora de eventos y fiestas que funciona en base a los principios de la economía social y solidaria.',NULL,NULL,'http://culturapopular.org','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'Ninguna','C/ Cebreros 1'),(211,'estatal',0,40.4063724952,-3.69943141937,'entities/58c73eb8-6512-4e3a-817e-17df060d3b04.jpg','',2015,'','Barenta Report','Barenta Report - Productora audiovisual',2,3,'<p><strong>V&iacute;deos que comunican optimismo</strong> con especial predilecci&oacute;n por los de tem&aacute;tica social y solidaria.V&iacute;deos para organizaciones, profesionales y particulares. Contenidos web, eventos, guiones, locuciones y fotograf&iacute;a digital.</p>\r\n\r\n<p><strong>Formaci&oacute;n audiovisual:</strong> cursos y&nbsp;talleres para adolescentes,&nbsp;personas adultas o colectivos de dinstina &iacute;ndole.</p>\r\n\r\n<p><strong>G&eacute;nero y Comunicaci&oacute;n</strong>: producci&oacute;n audiovisual propia para la difusi&oacute;n de actos, acontecimientos, actividades... relacionadas con la defensa de la igualdad, la visibilidad de la mujer y la denuncia de la violencia machista.</p>\r\n\r\n<p>Producci&oacute;n audiovisual de todos los v&iacute;deos, independientemente de su tem&aacute;tica, bajo una perspectiva de g&eacute;nero (respeto de la paridad en las entrevistas, respeto del lenguaje inclusivo en r&oacute;tulos y textos, gui&oacute;n y estructura de contenidos que garanticen la no discriminaci&oacute;n de la mujer&hellip;).</p>\r\n\r\n<p>Redacci&oacute;n, supervisi&oacute;n y correcci&oacute;n de guiones, art&iacute;culos o contenidos web bajo una perspectiva de genero y lenguaje inclusivo (consideramos que el castellano es muy rico y que hay muchas formas de dar vueltas al lenguaje para hacer que un texto sea inclusivo).</p>','https://www.facebook.com/BarentaReport',NULL,100,'PERIODISMO MULTIMEDIA Vídeos que comunican optimismo con especial predilección por los de temática social y solidaria. Vídeos para organizaciones, profesionales y particulares. Contenidos web, eventos, guiones, locuciones y fotografía digital.',NULL,'https://twitter.com/BarentaReport','http://www.barentareport.es','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'','Valencia 21 5ºC'),(212,'local',0,40.3925602914,-3.66887569427,'entities/e4a6f2fb-f26d-4d76-9484-41465ae9a65e.jpg','',2010,'','Brooklyn Boy S.L.','Bicicletos Viajes',3,3,'<p>Bicicletos Viajes es una iniciativa local que promociona y comercializa rutas en bicicleta. Consulta nuestra web donde podras encontrar m&aacute;s de 80 ideas para un buen viaje en bici.</p>','https://www.facebook.com/bicicletosviajes',NULL,100,'Proveedor de servicios turísticos en bicicleta',NULL,'https://twitter.com/bicicletosviaje','https://viajes.bicicletos.org','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'','Puerto Alto 54'),(213,'local',0,40.416887,-3.703549,'','',2013,'','ASOCIACIÓN LÍBERE EDUCACIÓN Y DESARROLLO','Biolibere Economato Ecológico',2,3,'Facilitamos el consumo de productos ecológicos a un coste razonable apoyando a productores locales respetuosos con el medio ambiente','https://www.facebook.com/biolibere.es/',NULL,75,'Facilitamos el consumo de productos ecológicos a un coste razonable apoyando a productores locales respetuosos con el medio ambiente',NULL,'https://twitter.com/Biolibere','http://www.biolibere.es','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'','Giralda s/n'),(214,'local',0,40.416887,-3.703549,'','',2016,'','CERVEZAS ECOLÓGICAS GABARRERA','CERVEZA GABARRERA SOCIEDAD COOPERATIVA MADRILEÑA',5,4,'La única cerveza con certificado ecológico de la CAM. Artesana, vegana, social local e innovadora.','https://es-es.facebook.com/cervezartesanagabarrera/','https://instagram.com/cervezasgabarrera',100,'La única cerveza con certificado ecológico de la CAM. Artesana, vegana, social local e innovadora.',NULL,'https://twitter.com/CervezGabarrera','https://cervezasgabarrera.com/','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'','Plaza de Santa Águeda 7, local 2'),(215,'local',0,40.416887,-3.703549,'','',2017,NULL,'Correcaminos, S. Coop. Mad','CLETA APP',2,3,'Nuestra actividad está basada en una aplicación móvil (y página web, www.cleta.n