EALOGA PSICOLOG&Iacute;A</span></a></h1>\r\n\r\n<h3 style=\"text-align:center\"><span style=\"font-size:26px\">&nbsp;&Psi; </span></h3>\r\n\r\n<h3 style=\"text-align:center\"><span style=\"font-size:18px\">Terapia psicol&oacute;gica y servicios de asesoramiento y formaci&oacute;n para el desarrollo personal</span></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ofrecemos terapia psicol&oacute;gica y servicios de asesoramiento y formaci&oacute;n para el desarrollo personal. Con ello buscamos el empoderamiento de las personas mediante el aprendizaje de habilidades como el autoconocimiento, el pensamiento cr&iacute;tico, la toma de decisiones o la regulaci&oacute;n emocional.</p>\r\n\r\n<p>Prestamos servicios especializados en el tratamiento de problemas emocionales como el estr&eacute;s, la ansiedad o la depresi&oacute;n; en problemas de comportamiento en la infancia y la juventud; y en el asesoramiento para la mejora de la comunicaci&oacute;n y el desarrollo personal. Trabajamos en los &aacute;mbitos individual, de pareja, familiar y grupal.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div>\r\n<div>\r\n<div>\r\n<div>\r\n<h3><strong>&Aacute;reas de especializaci&oacute;n</strong></h3>\r\n</div>\r\n\r\n<div>\r\n<div>\r\n<h4><strong>Terapia individual</strong></h4>\r\n\r\n<ul>\r\n	<li>Para personas adultas: ansiedad, depresi&oacute;n, estr&eacute;s, duelos, adicciones, control de impulsos, fobias, asesoramiento en sexualidad&hellip;</li>\r\n	<li>Para adolescentes: trastornos de conducta, control de impulsos, adicciones, dificultades escolares, duelos, trastornos de alimentaci&oacute;n&hellip;</li>\r\n	<li>Para infancia: miedos, dificultades escolares, hiperactividad, d&eacute;ficit de atenci&oacute;n, duelos&hellip;</li>\r\n</ul>\r\n\r\n<h4><strong>Terapia de Pareja</strong></h4>\r\n\r\n<p>Crisis, dificultades de comunicaci&oacute;n, infidelidades, celos&hellip;</p>\r\n</div>\r\n</div>\r\n\r\n<div>\r\n<div>\r\n<h4><strong>Terapia online</strong></h4>\r\n\r\n<p>Ansiedad, depresi&oacute;n, estr&eacute;s, duelos&hellip;</p>\r\n\r\n<h4><strong>Acompa&ntilde;amiento terap&eacute;utico</strong></h4>\r\n\r\n<p>Adicciones, psicosis, fobias, trastornos de alimentaci&oacute;n, trastornos de personalidad&hellip;</p>\r\n\r\n<h4><strong>Talleres y Grupos Terap&eacute;uticos</strong></h4>\r\n\r\n<p>Mindfulness, comunicaci&oacute;n, relajaci&oacute;n, crecimiento y desarrollo personal&hellip;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div>\r\n<h3><a href=\"https://www.idealoga.org/servicios/idealoga-psicologia/#equipo\"><strong>Nuestro equipo</strong></a></h3>\r\n</div>\r\n\r\n<div>\r\n<div>\r\n<p>Somos profesionales de la psicolog&iacute;a comprometidos con la mejora continua de nuestras competencias y saberes.</p>\r\n\r\n<p>Nuestras intervenciones est&aacute;n avaladas por el conocimiento cient&iacute;fico. Para mejorarlas realizamos procesos de supervisi&oacute;n basados en la inteligencia colectiva y la interdisciplinariedad.</p>\r\n\r\n<p>Diversas trayectorias, enfoques y experiencias enriquecen nuestro saber hacer y nos permiten poner a tu disposici&oacute;n la mejor soluci&oacute;n posible.</p>\r\n</div>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div>\r\n<h3><a href=\"https://www.idealoga.org/contacto/\"><strong>D&oacute;nde estamos</strong></a></h3>\r\n</div>\r\n\r\n<div>\r\n<div>\r\n<p>Paseo de las Acacias 5, 1&ordm; D, Madrid</p>\r\n\r\n<p><span style=\"font-size:16px\"><u>915 21 15 33</u></span></p>\r\n\r\n<p>Metro: Embajadores y Acacias</p>\r\n\r\n<p>Renfe: Embajadores</p>\r\n\r\n<p>Autobuses: C1, 27, 34, 36, 116, 118, 119</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','https://www.facebook.com/IdealogaPsicologia',NULL,100,'Psicología para la transformación social: Terapia y desarrollo personal, formación, intervención comunitaria, investigación social, consultoría y asesoramiento.',NULL,'https://twitter.com/idealoga','http://www.idealoga.org','','',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,'Paseo de las Acacias 5, 1º D, Madrid / 915 21 15 33'),(261,'local',0,40.4102590921766,-3.70049625635147,'entities/3dfae049-74ef-4e9c-8336-71699884d621.jpg','',2011,NULL,'Indaga S. Coop. Mad.','Indaga',2,3,'<p>Investigaci&oacute;n social. Servicios de apoyo, asesor&iacute;a y coordinaci&oacute;n de proyectos de investigaci&oacute;n; estrategias de difusi&oacute;n de resultados; formaci&oacute;n en metodolog&iacute;as de las ciencias sociales.</p>',NULL,NULL,100,'Investigación social. Servicios de apoyo, asesoría y coordinación de proyectos de investigación; estrategias de difusión de resultados; formación en metodologías de las ciencias sociales.',NULL,NULL,'http://www.indaga.org','','',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,'C/ Esperanza 5'),(262,'local',0,40.4051306975,-3.70352983475,'entities/663815cd-4306-4c9c-9f4d-543ab1dae109.jpg','',2012,NULL,'Sociedad Cooperativa Madrileña','Indaga Research',2,3,'<p>Investigaci&oacute;n Social y Estudios de Mercado. Evaluaciones de Programas, Proyectos, Campa&ntilde;as, Pol&iacute;ticas P&uacute;blicas, etc.</p>','@IndagaResearch',NULL,50,'Investigación Social y Estudios de Mercado. Evaluaciones de Programas, Proyectos, Campañas, Políticas Públicas, etc.','+34687263282','@IndagaResearch','http://www.indaga-research.com','','',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,'Paseo de Acacias 3, 1º A'),(263,'local',0,40.427583,-3.676872,'entities/51522e47-1cb8-4534-a4a3-0f0014fcf582.jpg','',2000,NULL,'José Luis Santacruz Sánchez','Gabinete de Ostepoatía HON-bienestar',25,25,'<p>&nbsp;&nbsp;&nbsp; HON-bienestar, gabinete de osteopat&iacute;a y procedimientos naturales para el bienestar.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp; Con un enfoque global, cada usuario recibe un trato individualizado seg&uacute;n sus necesidades personalizadas. Aplicamos la osteopat&iacute;a desde una perspectiva estructural, biomec&aacute;nica y energ&eacute;tica teniendo en cuenta sus interrelaciones; reforzamos su efecto con otros procedimientos naturales para que consigas un estado de satisfacci&oacute;n f&iacute;sica, mental y emocional.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp; Estos procedimientos son &uacute;tiles en problemas del aparato locomotor, viscerales, nerviosos, endocrinos o sicosom&aacute;ticos; como prevenci&oacute;n o por estar bien.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp; Telf y wasap: 679.327.231</p>','https://www.facebook.com/JoseLuiSantacruz/',NULL,100,'HON-bienestar,gabinete de osteopatía, terapias naturales no sanitarias conducido por José Luis Santacruz, osteópata y naturópata, asociado a Cofenat 1529.Situado en el centro de Madrid,nuestros clientes reciben un trato profesional e individualizado.',NULL,NULL,'http://www.honbienestar.es','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'Los porcentajes de bonificaciÃ³n se aplicarÃ¡n antes de IVA','Ayala, 65. Esc. dcha. 1º izq.'),(264,'local',0,40.416887,-3.703549,'','',1984,'','Asociación Apoyo','Jugando juguetes',10,10,'Juguetes de Segunda Mano que cuidan el mundo.',NULL,NULL,30,'Juguetes de Segunda Mano que cuidan el mundo.',NULL,NULL,'http://Jugandojuguetes.blogspot.com.es','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'','Corregidor Diego Valderrabano 45'),(265,'local',0,40.4065992025,-3.69755655527,'entities/913bc0ba-f384-4e7b-8e8a-086c1b771c25.jpg','',2006,NULL,'Kinema, S. Coop. Mad.','Kinema',3,3,'<ul>\r\n	<li>Consultor&iacute;a en econom&iacute;a social</li>\r\n	<li>Gestor&iacute;a contable, fiscal y laboral</li>\r\n	<li>Asesor&iacute;a jur&iacute;dica</li>\r\n	<li>Psicolog&iacute;a</li>\r\n</ul>','https://www.facebook.com/KinemaCoop/',NULL,100,'Asesoría jurídica, psicología, gestoría de emrpesas, formación y fomento del cooperativismo y la economía social.',NULL,'https://twitter.com/CoopKinema','http://cooperativakinema.es','','',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,'Ronda de Atocha, nº18, 1º C'),(266,'local',0,40.416887,-3.703549,'','',2016,NULL,'Raul Alonso','Klorofila',3,3,'Nos dedicamos a la arquitectura bioclimática, la ecología urbana y rural, y a desarrollar actividades para promover hábitos de vida más sostenibles en diferentes ámbitos',NULL,NULL,100,'Nos dedicamos a la arquitectura bioclimática, la ecología urbana y rural, y a desarrollar actividades para promover hábitos de vida más sostenibles en diferentes ámbitos',NULL,NULL,'http://www.klorofila.net','','',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,'Paseo de las Acacias, 3, 1ºA,'),(267,'local',0,40.407816,-3.703664,'entities/db0a5090-f89c-49a5-b311-d246139b4869.jpg','',2011,NULL,'La Casquería','La Casquería, libros al peso',10,10,'<p style=\"margin-left:0px; margin-right:0px; text-align:left\"><strong>Vendemos libros de segundamano al peso, a 10 euros el kilo de libros. </strong>El sistema es sencillo, coges un libro, lo pesas, lo pagas y te lo llevas. (Si por ejemplo pesa 250 gramos pues te costar&aacute; 2,5 euros).</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\">La Casquer&iacute;a es un proyecto colectivo que <strong>pone en valor el reciclaje y la recirculaci&oacute;n de la cultura y el libro</strong> (como su soporte material) a trav&eacute;s de la venta de libro usado a <strong>bajo precio.</strong></p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\">Estamos dentro del Mercado de San Fernando en la Calle Embajadores 41, en el barrio de Lavapi&eacute;s.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\">Somos un equipo de seis personas, algunas socias colaboradoras y otras socias trabajadoras, que trata de funcionar con un modelo mixto de trabajo y colaboraci&oacute;n que haga sostenible el proyecto. Estamos en el intento, y la cooperaci&oacute;n est&aacute; en la base de nuestro modelo de funcionamiento. La Casquer&iacute;a forma parte adem&aacute;s de la red Mercado Social de Madrid y comparte los principios de la econom&iacute;a social y solidaria.</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\">&nbsp;</p>','https://www.facebook.com/lacasquerialibros/',NULL,100,'Libros de segunda mano al peso.',NULL,'https://twitter.co