marca a crecer, fomentando el bien común.',NULL,'https://twitter.com/LamanadaAgencia','http://www.lamanada.es','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'','Antonio Grillo 11 3A'),(271,'local',0,40.3936838389,-3.66277098656,'','',2017,'','IMPULSACOOP S.COOP.MAD','La Pájara Ciclomensajería',3,3,'<p>Cooperativa de ciclomensajer&iacute;a en Madrid. Repartimos exclusivamente en bicicleta y ofrecemos una alternativa &eacute;tica a las grandes plataformas.</p>\r\n\r\n<p>Nos enfocamos en el reparto de&nbsp;productos ecol&oacute;gicos, paqueter&iacute;a y distribuci&oacute;n de &uacute;ltima milla. A trav&eacute;s del Mercado Social ofrecemos el servicio de mensajeria: todo tipo de paquete y producto (excluyendo comida preaparada) con un maximo de 25kg, preferiblemente en el centro de Madrid.</p>','https://www.facebook.com/lapajaraenbici','https://www.instagram.com/lapajaraenbici/',100,'Cooperativa de ciclomensajerí­a en Madrid Repartimos exclusivamente en bicicleta y ofrecemos una alternativa ética a las grandes plataformas. Nos enfocamos en el reparto de comida, productos ecológicos, paquetería y distribución de última milla.',NULL,'https://twitter.com/ridersxdMAD','https://lapajaraenbici.com/','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'','Plaza Sierra Ministra 8-2'),(272,'estatal',0,40.416887,-3.703549,'','',2009,'','La Rueda ETC','La Rueda Teatro Social',2,3,'Intervención social, educativa y comunitaria. Espectáculos de Teatro Social. Facilitación de grupos a través del teatro. Formación.','https://www.facebook.com/La-Rueda-Teatro-Social-308449785887003/timeline/',NULL,50,'Intervención social, educativa y comunitaria. Espectáculos de Teatro Social. Facilitación de grupos a través del teatro. Formación.',NULL,NULL,'http://www.laruedateatrosocial.com','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'','C/ Mayor 77, 4º B.'),(273,'local',0,40.407711,-3.703823,'entities/52987b5c-2286-4c1e-9f17-e32937912d74.jpg','',2014,NULL,'Solsticio centro promotor para el desarrollo de la energía solar en Mesoamérica','La Tienda de las Hamacas',5,3,'<p>Venta de hamacas hechas a mano en telar por mujeres de comunidades rurales mayas con el objetivo de generar recursos para llevar a cabo proyectos de difusi&oacute;n, promoci&oacute;n y uso de la energ&iacute;a solar en Mesoam&eacute;rica.</p>\r\n\r\n<p>En las hamacas maya el suave tejido forma una fina red que se adapta ergon&oacute;micamente al cuerpo envolvi&eacute;ndolo, son muy anchas, de esta forma puedes tumbarte en diagonal o transversalmente, manteniendo la espalda recta y protegida.</p>\r\n\r\n<p>En el sur de M&eacute;xico con c&aacute;lidas temperaturas la mayor parte del a&ntilde;o, la hamaca se usa cotidianamente en vez de la cama&nbsp; pues la trama deja pasar el aire siendo la mejor soluci&oacute;n contra el calor.</p>\r\n\r\n<p style=\"text-align:center\"><em>Mecerse en una hamaca, colgada entre dos &aacute;rboles o en tu rinc&oacute;n favorito de la casa, es la manera m&aacute;s relajada de descansar del ajetreo que nos impone el &ldquo;estr&eacute;s&rdquo; de la vida actual</em></p>\r\n\r\n<p>Preparadas para resistir de 150 a 500 kg de peso, seg&uacute;n el tama&ntilde;o.</p>\r\n\r\n<p>El secreto del gran peso que pueden&nbsp; soportar una hamaca es la trama del tejido, dicha trama no tiene nudos, todos&nbsp; los hilos se comunican entre s&iacute;, por eso el peso se reparte entre toda la superficie de la malla, sin crear puntos de tensi&oacute;n.</p>\r\n\r\n<p>Estamos en&nbsp;Mercado de San Fernando&nbsp; Puesto 40 bis&nbsp; c/ Embajadores 41.</p>','https://www.facebook.com/hamacas.org/',NULL,100,'Venta de hamacas hechas a mano en telar por mujeres de comunidades rurales con el objetivo de generar recursos para llevar a cabo proyectos de difusión, promoción y uso de la energía solar en Mesoamérica.',NULL,NULL,'https://hamacas.org','','',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,'Mercado de San Fernando  Puesto 40 bis  c/ Embajadores 41'),(274,'local',0,40.416887,-3.703549,'','',2017,NULL,'Latitud 40 S.