. Aplicamos metodologías de Design Thinking para lograr que las soluciones que aportamos sean relevantes para las personas.','https://www.facebook.com/materiaprimainnovacion/','https://www.instagram.com/_materia_prima/',100,'Apoyamos el desarrollo de cualquier organización a través de la formación, el diseño de servicios y la facilitación de procesos. Aplicamos metodologías de Design Thinking para lograr que las soluciones que aportamos sean relevantes para las personas.',NULL,NULL,'http://www.materiaprima.net','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'Ninguna','C/ Bravo Murillo 33, Bajo centro'),(283,'local',0,40.416887,-3.703549,'','',2013,NULL,'Mayú Sociedad Cooperativa','Mayú Sociedad Cooperativa',2,3,'Asesoría legal, laboral, fiscal y contable. Redacción y gestión de proyectos. Formación. (Tu gestionas tus sueños y nosotras gestionamos tus pesadillas)',NULL,NULL,0,'Asesoría legal, laboral, fiscal y contable. Redacción y gestión de proyectos. Formación. (Tu gestionas tus sueños y nosotras gestionamos tus pesadillas)',NULL,NULL,'http://mayucooperativa.org','','',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,'c/ Duque de Fernán Nuñez, 2-1º'),(284,'local',0,40.416887,-3.703549,'','',2010,NULL,'MenosMedia Comunicación','MenosMedia',5,5,'MenosMedia es un estudio cooperativo de comunicación especializado en diseño gráfico y audiovisual, orientado a las temáticas sociales y medioambientales.',NULL,NULL,20,'MenosMedia es un estudio cooperativo de comunicación especializado en diseño gráfico y audiovisual, orientado a las temáticas sociales y medioambientales.',NULL,'https://twitter.com/MenosMedia','http://www.menosmedia.org','','',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,'Don Pedro 6'),(285,'local',0,40.4112659354,-3.70502248406,'entities/ad30a69e-3ae0-4fb8-b1cd-f9c2345972cd.jpg','',2013,'Alba Villanueva','Asociación Meta-Comunicación para la libertad de información y comunicación','Meta Comunica',3,3,'<p style=\"text-align:justify\"><span style=\"font-size:14px\">Agencia social de <strong>comunicaci&oacute;n para entidades &eacute;ticas</strong> que contribuye a <strong>dar visibilidad a proyectos sociales y aumentar su repercusi&oacute;n.</strong></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\"><em>No importa si s&oacute;lo buscas cubrir unas necesidades concretas o quieres desarrollar un plan de comunicaci&oacute;n integral, lo importante es que la comunicaci&oacute;n te importa, y ese es un gran paso.</em></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\"><em>Si bien creemos que la comunicaci&oacute;n hay que cuidarla en todos sus campos, tambi&eacute;n sabemos que no es una tarea f&aacute;cil y que lo importante es empezar, por lo que nos ajustamos a las demandas concretas de los proyectos con los que colaboramos.</em></span></p>\r\n\r\n<p style=\"text-align:justify\"><strong><span style=\"font-size:14px\">&iquest;Hablamos?</span></strong></p>\r\n\r\n<p>En Meta-Comunica <strong>asesoramos y formamos en comunicaci&oacute;n</strong> para conseguir que las personas o proyectos sociales con los que colaboramos mantengan una comunicaci&oacute;n activa que aumente su visibilidad y su repercusi&oacute;n a nivel social. Ofrecemos apoyo en el <strong>dise&ntilde;o de estrategias y planes de comunicaci&oacute;n</strong>, realizamos <strong>formaciones en t&eacute;cnicas de comunicaci&oacute;n</strong> y estudiamos el estado para <strong>desarrollar propuestas que mejoran la comunicaci&oacute;n interna</strong>.</p>\r\n\r\n<p>Tambi&eacute;n ofrecemos apoyo en las distintas labores de difusi&oacute;n que necesitan las personas o entidades con las que colaboramos. Desarrollamos <strong>planes de difusi&oacute;n en medios, campa&ntilde;as para redes sociales, redactamos contenidos para prensa, web y rrss, hacemos reportajes fotogr&aacute;ficos y materiales audiovisuales y gr&aacute;ficos.</strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong>Meta-Comunica</strong> est&aacute; formada por profesionales con amplia experiencia en la coordinaci&oacute;n, dise&ntilde;o y desarrollo de<strong> estrategias de comunicaci&oacute;n en medios y redes sociales</strong>, y en <strong>campa&ntilde;as de sensibilizaci&oacute;n e incidencia social</strong> a trav&eacute;s de la comunicaci&oacute;n y el arte.</p>\r\n\r\n<p style=\"text-align:justify\">El equipo de Meta-Comunica re&uacute;ne a profesionales especializadas en campos como Periodismo, Comunicaci&oacute;n Audiovisual, Derecho o Humanidades que trabajan en distintas &aacute;reas de la comunicaci&oacute;n: <strong>medios, redes sociales, dise&ntilde;o gr&aacute;fico, producci&oacute;n audiovisual, marketing o desarrollo de t&eacute;cnicas y metodolog&iacute;as creativas </strong>para fomentar la participaci&oacute;n social a trav&eacute;s de la comunicaci&oacute;n y el arte.</p>\r\n\r\n<p style=\"text-align:justify\">Somos una <strong>red de profesionales</strong> con experiencia trabajando juntas en diferentes proyectos. Basamos nuestro sistema de trabajo en la coordinaci&oacute;n de equipos por proyecto. Para ello, contamos con fluidos canales de comunicaci&oacute;n interna y sistemas para organizar nuestro trabajo de forma presencial y online.</p>','https://www.facebook.com/MetaComunica/',NULL,25,'Agencia social de comunicación para entidades éticas.',NULL,'https://twitter.com/MetaComunicaes','http://www.metacomunica.net','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'','Calle Mesón de Paredes 12, 2 izquierda (28012) Madrid'),(286,'local',0,40.416887,-3.703549,'','',2014,NULL,'Milhojas-Ecopapeleria S. Coop. Mad.','Milhojas-Ecopapeleria',2,3,'Comercialización online, de material de oficina: papelería, consumibles, limpieza,... para entidades, grupos de consumo..., siguiendo criterios de sostenibilidad y respeto medioambiental',NULL,NULL,10,'Comercialización online, de material de oficina: papelería, consumibles, limpieza,... para entidades, grupos de consumo..., siguiendo criterios de sostenibilidad y respeto medioambiental',NULL,NULL,'http://www.milhojaseco.es','','',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,'Ronda de Segovia 41, 1A'),(287,'estatal',0,40.416887,-3.703549,'','',2013,NULL,'Mint 57 Grados SL','Mint 57',2,2,'Mint 57 Earth-friendly Adventures Viajes de aventura fuera de las rutas convencionales hacia aquellos rincones del mundo que todavía se escapan del turismo de masas. Viajes inspirados por la naturaleza con un enfoque sostenible.','https://www.facebook.com/bluavoluntariado','https://www.instagram.com/goblua/',0,'Mint 57 Earth-friendly Adventures Viajes de aventura fuera de las rutas convencionales hacia aquellos rincones del mundo que todavía se escapan del turismo de masas. Viajes inspirados por la naturaleza con un enfoque sostenible.',NULL,'https://twitter.com/mint57travel','http://mint57.com/','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'Estudiando como se harÃ¡ el pago con moneda social','Calle Hermosilla 48'),(288,'estatal',0,40.3460964342,-3.71054649353,'entities/a0a98072-0d00-456f-a9e4-ad44f0b61b94.jpg','',2014,'Laura','A3Ceres Asesoría Agroalimentaria','Moringa Smile',2,2,'<p>&iquest;Conoces la <strong><span style=\"background-color:null\">moringa</span></strong>? &iexcl;Posiblemente la especie vegetal m&aacute;s nutritiva que existe! Sus hojas poseen: 28% prote&iacute;na, 30% fibra, calcio, potasio, hierro, vitaminas A, C y D, amino&aacute;cidos y antioxidantes.&nbsp;<strong><span style=\"background-color:null\">Moringa</span></strong>Smile es un proyecto social y solidario que desarrolla distintos puntos en torno a la moringa, <em>el &aacute;rbol de la vida</em>. Desarrollamos I+D+i, cultivamos en&nbsp;ecol&oacute;gico en Tenerife y comercializaci&oacute;n a nivel estatal la hoja de moringa.</p>','https://www.facebook.com/MoringaGreen/','https://www.instagram.com/moringasmile/',100,'MoringaSmile es un proyecto social y solidario que desarrolla distintos puntos en torno a la moringa, el árbol de la vida. Tenemos un proyecto de I+D, cultivo ecológico