vo el IVA para los servicios contratados dentro de la red MES','Calle Rosario Nº 15'),(303,'local',0,40.838814,-3.49895,'entities/22813ba8-c563-4ad2-a6d6-f93e8c0c7848.jpg','',2016,NULL,'Quesopía S.L.','Quesería Jaramera',5,5,'<p>Nos dedicamos a la elaboraci&oacute;n de productos l&aacute;cteos de forma artesanal.</p>\r\n\r\n<p>Todos nuestros quesos est&aacute;n elaborados a partir de leche pasteurizada de oveja (pasteurizaci&oacute;n lenta en cuanto abierta), cuajo vegetal (cuajo de cardo) y sal marina sin refinar. Las cortezas de nuestros quesos son comestibles y los embalajes que usamos son reciclados, biodegradables o compostables.</p>\r\n\r\n<p>Dentro de la queser&iacute;a garantizamos que no existen trazas de gluten en el proceso de elaboraci&oacute;n y todos los ingredientes usados est&aacute;n certificados libres de gluten para que las personas cel&iacute;acas puedan consumir nuestros productos.</p>','https://m.facebook.com/pages/category/Local-Business/JarameraQueseria/about/',NULL,10,'Nos dedicamos a la elaboración de productos lácteos de forma artesanal.',NULL,NULL,'http://www.queseriajaramera.com','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'Ninguno','Calle Torrearte 2, nave 10'),(304,'local',0,40.416887,-3.703549,'','',2009,NULL,'Cooperativa de Iniciativa Social','Recumadrid S Coop Mad Iniciativa Social',2,3,'Trabajamos la inserción sociolaboral de colectivos en riesgo de exclusión social a través de la recuperación y reciclaje de enseres voluminosos, textiles, juguetes, libros, etc.',NULL,NULL,50,'Trabajamos la inserción sociolaboral de colectivos en riesgo de exclusión social a través de la recuperación y reciclaje de enseres voluminosos, textiles, juguetes, libros, etc.',NULL,NULL,'http://www.recumadrid.es','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'Ninguna','C/ Villaamil, 28'),(305,'local',0,40.416887,-3.703549,'','',2009,'','Red Jurídica','Red Jurídica',2,5,'Cooperativa multidisciplinar de abogados que ejercen el derecho desde una perspectiva crítica.',NULL