ULL,'',NULL,NULL,NULL,NULL,'','c/ Alberto Aguilera, 7'),(316,'local',0,40.416887,-3.703549,'','',2014,'','TEATRO DEL BARRIO SOCIEDAD COOPERATIVA MADRILEÑA DE CONSUMO','Teatro del Barrio',1,3,'<p>La voluntad con que abrimos el Teatro del Barrio es abiertamente pol&iacute;tica: participar en el movimiento ciudadano que ya est&aacute; construyendo otra forma de convivir. hacer pol&iacute;tica son la cultura y la fiesta. Teatro, m&uacute;sica, poes&iacute;a, baile, talleres...</p>','https://www.facebook.com/tuteatrodelbarrio',NULL,100,'La voluntad con que abrimos el Teatro del Barrio es abiertamente política: participar en el movimiento ciudadano que ya está construyendo otra forma de convivir. hacer política con la cultura y la fiesta. Teatro, música, poesía, baile, talleres...',NULL,'https://twitter.com/teatrobarrio','http://teatrodelbarrio.com/','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'','C/ ZURITA, 20'),(317,'estatal',0,40.416887,-3.703549,'','',2011,NULL,'Teatro Revolucionario para el Empoderamiento Social','TR3S SOCIAL',2,3,'Desde un enfoque sistémico y de facilitación de grupos, desarrollamos procesos de medio y largo plazo usando el teatro social/teatro de lxs oprimidxs al servicio de la resolución de conflictos, el desarrollo comunitario y el cambio cultural.',NULL,NULL,0,'Desde un enfoque sistémico y de facilitación de grupos, desarrollamos procesos de medio y largo plazo usando el teatro social/teatro de lxs oprimidxs al servicio de la resolución de conflictos, el desarrollo comunitario y el cambio cultural.',NULL,NULL,'http://www.3social.org/','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'En funciÃ³n reboniato','C/ Cea Bermudez 45, 5d'),(318,'estatal',0,40.416887,-3.703549,'','',2018,NULL,'Tras El Telón SCCL','Teatro Sobre Ruedas',2,3,'Teatro móvil para dar la posibilidad a cualquier ciudadano a disfrutar, entender y comprender el arte acercándolo a nuevos espacios. Destinado por y para la realización de espectáculos de artes escénicas, sonoras y visuales','https://www.facebook.com/TeatroSobreRuedas','https://www.instagram.com/teatrosobreruedas/',100,'Teatro móvil para dar la posibilidad a cualquier ciudadano a disfrutar, entender y comprender el arte acercándolo a nuevos espacios. Destinado por y para la realización de espectáculos de artes escénicas, sonoras y visuales',NULL,NULL,'https://teatrosobreruedas.wordpress.com','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'Ninguna','C/ Enrique Moyano, 4 2º 1ª'),(319,'local',0,40.416887,-3.703549,'','',2014,NULL,'The Circular Project','The Circular Project',2,3,'Proyecto integral de moda sostenible que da cobertura a las marcas de moda sostenible con la finalidad de serviles de altavoz y darlas a conocer',NULL,NULL,100,'Proyecto integral de moda sostenible que da cobertura a las marcas de moda sostenible con la finalidad de serviles de altavoz y darlas a conocer',NULL,'https://twitter.com/CircularProject','http://www.thecircularproject.com','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'Ninguna','Calle Ventura Rodríguez 22'),(320,'local',0,40.411784,-3.706256,'entities/80dd8575-1a07-4e28-bc7e-41f5684c3d80.jpg','',1997,'','Traficantes de sueños, S.C.','Traficantes de sueños',2,5,'<p><strong>Traficantes de Sue&ntilde;os</strong>&nbsp;es un proyecto de producci&oacute;n y comunicaci&oacute;n pol&iacute;tica que aspira a aportar contenidos y animar debates &uacute;tiles para la acci&oacute;n colectiva transformadora. Tambi&eacute;n es un proyecto de econom&iacute;a social, esto es, una entidad sin &aacute;nimo de lucro y sin jefes, implicada en el&nbsp;<u><a href=\"http://www.konsumoresponsable.coop/mercado-social-madrid\" rel=\"noopener noreferrer\" target=\"_blank\">mercado social</a>&nbsp;</u>y en el desarrollo de otra econom&iacute;a.</p>\r\n\r\n<p>Traficantes de Sue&ntilde;os inici&oacute; su andadura en 1995 con el objetivo de generar un espacio estable donde encontrar materiales de reflexi&oacute;n; la herramienta que utilizamos para ello es el libro, entendi&eacute;ndolo como un medio de transformaci&oacute;n individual y colectiva. A partir de ah&iacute; comenzamos a organizar la librer&iacute;a asociativa y la distribuidora; en los 2000 llegaron la editorial, el taller de dise&ntilde;o y el espacio para la autoformaci&oacute;n y producci&oacute;n de Nociones Comunes.</p>\r\n\r\n<p>Nuestro espacio, no solo es la sede de la librer&iacute;a, sino que es un espacio colectivo, abierto a la ciudad, que acoge multitud de presentaciones, proyecciones, reuniones, talleres y debates. Puedes apuntarte a nuestro bolet&iacute;n informativo mensual&nbsp;<u><a href=\"https://traficantes.net/suscripciones\">aqu&iacute;</a></u></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>Los proyectos de TdS</h3>\r\n\r\n<p>La&nbsp;<u><a href=\"https://traficantes.net/tienda\">librer&iacute;a asociativa</a></u>&nbsp;TdS est&aacute; especializada en ensayo cr&iacute;tico para los movimientos sociales y narrativas de otros mundos; es &quot;asociativa&quot; porque tiene socios que se comprometen a hacer un gasto mensual a cambio de un descuento. La&nbsp;<u><a href=\"https://traficantes.net/editorial\">editorial</a></u>&nbsp;TdS publica textos de fondo y de coyuntura con licencias Creative Commons que permiten la libre copia y descarga; tambi&eacute;n se desarrolla gracias a suscriptores, que por una cuota anual reciben todas las novedades y otros servicios. La&nbsp;<u><a href=\"https://traficantes.net/distribuidora\">distribuidora</a></u>&nbsp;TdS trae libros de otras partes del mundo y mueve textos de peque&ntilde;as editoriales alternativas. El&nbsp;<u><a href=\"http://taller.traficantes.net/\">taller&nbsp;</a></u>TdS genera dise&ntilde;os y materiales, sobre todo, para otros proyectos de la econom&iacute;a social. El proyecto&nbsp;<u><a href=\"http://nocionescomunes.wordpress.com/\" rel=\"noopener noreferrer\" target=\"_blank\">Nociones Comunes</a></u>&nbsp;ha abierto un espacio de autoformaci&oacute;n y discusi&oacute;n sobre diversas tem&aacute;ticas imprescindible en nuestros d&iacute;as. TdS en la Red dinamiza toda esta producci&oacute;n del proyecto y de la gente que lo usa, en forma de informaci&oacute;n y de audios.</p>\r\n\r\n<h3>Empresa pol&iacute;tica - Econom&iacute;a social</h3>\r\n\r\n<p>Parecer&iacute;a que estos pares de t&eacute;rminos son antag&oacute;nicos, &iquest;puede ser una empresa algo pol&iacute;tico? &iquest;Puede ser la econom&iacute;a algo social? Las empresas son de hecho algo muy pol&iacute;tico. Parece que solo hay un tipo de empresa: la empresa capitalista que conocemos, cuyo &uacute;nico objetivo es obtener beneficios por encima de las personas y del planeta.</p>\r\n\r\n<p>Pero varias personas se pueden unir para poner en marcha proyectos productivos, que generen empleos, bienes y servicios, a partir de principios &eacute;ticos. Esta es la base de la econom&iacute;a social que ya cuenta, en todo el Estado y todo el mundo, con miles de cooperativas, asociaciones y empresas que producen seg&uacute;n otro modelo econ&oacute;mico. Su objetivo no es acumular beneficios, sino generar bienes y servicios a trav&eacute;s de estructuras productivas justas, donde primen la igualdad laboral, la igualdad de g&eacute;nero y el respeto por el planeta.</p>\r\n\r\n<p>TdS es un proyecto de econom&iacute;a social y una empresa pol&iacute;tica. Es una asociaci&oacute;n sin &aacute;nimo de lucro donde los trabajadores mandan. Un espacio productivo donde se tiene muy en cuenta lo que puede ser pol&iacute;ticamente &uacute;til a los movimientos y colectivos que buscan la transformaci&oacute;n del estado actual de las cosas. A su vez, TdS puede aportar porque est&aacute; inmerso en el tejido vivo de la ciudad. Como muchos otros proyectos de la econom&iacute;a social, sobrevive gracias a la comunidad que elige apoyarlo porque considera que es un recurso valioso para todos y todas.</p>\r\n\r\n<h3>Cultura libre</h3>\r\n\r\n<p>Una se&ntilde;a de identidad del proyecto es su apuesta por la cultura libre. Los movimientos por la cultura libre abogan por la libre difusi&oacute;n del conocimiento y las expresiones art&iacute;sticas de la sociedad. Entienden que estos saberes son resultado de la colaboraci&oacute;n social y que bloquearlos a trav&eacute;s de las leyes de propiedad intelectual es perjudicial para el desarrollo de la sociedad y de cada uno de sus miembro.</p>\r\n\r\n<p>Por eso, los textos de la editorial TdS se publican con&nbsp;<u><a href=\"http://es.creativecommons.org/blog/\" rel=\"noopener noreferrer\" target=\"_blank\">licencias Creative Commons</a></u>&nbsp;que permiten la libre copia y distribuci&oacute;n sin &aacute;nimo de lucro; en el momento en que nuestros libros salen a la calle, colgamos un PDF en nuestra web para libre descarga, a disposici&oacute;n de la gente que quiera replicar esos contenidos.</p>\r\n\r\n<p>Pero<em>&nbsp;libre</em>&nbsp;no es&nbsp;<em>gratis</em>&nbsp;y los proyectos de cultura libre necesitan la corresponsabilidad de la comunidad, esto es, que aquellos que apuestan por la libre difusi&oacute;n de la cultura los sustenten de m&uacute;ltiples formas.</p>\r\n\r\n<h3>Las redes de TdS</h3>\r\n\r\n<p>TdS participa en la&nbsp;<u><a href=\"http://fundaciondeloscomunes.net/\" rel=\"noopener noreferrer\" target=\"_blank\">Fundaci&oacute;n de los Comunes</a></u>, una iniciativa compartida con el&nbsp;<u><a href=\"http://ateneucandela.info/\" rel=\"noopener noreferrer\" target=\"_blank\">Ateneu Candela</a></u>&nbsp;de Terrassa, la&nbsp;<u><a href=\"http://www.lainvisible.net/\" rel=\"noopener noreferrer\" target=\"_blank\">Casa Invisible</a></u>&nbsp;de M&aacute;laga. A partir de esta federaci&oacute;n, propulsamos el proyecto Nociones Comunes a nivel estatal y animamos la producci&oacute;n de an&aacute;lisis y de investigaciones, como con el&nbsp;<a href=\"http://www.observatoriometropolitano.org/\" rel=\"noopener noreferrer\" target=\"_blank\"><u>Observatorio Metropolitano&nbsp;</u></a><u><a href=\"http://www.observatoriometropolitano.org/%E2%80%8E\" rel=\"noopener noreferrer\" target=\"_blank\">de Madrid</a></u><a href=\"http://www.observatoriometropolitano.org/\" rel=\"noopener noreferrer\" target=\"_blank\"><u>&nbsp;</u></a>y&nbsp;<u><a href=\"http://stupidcity.net/\" rel=\"noopener noreferrer\" target=\"_blank\">de Barcelona</a></u>, o&nbsp;<u><a href=\"http://azofra.wordpress.com/\" rel=\"noopener noreferrer\" target=\"_blank\">Azofra</a></u>en Zaragoza. Tambi&eacute;n forman parte de la red otros proyectos-librer&iacute;as como&nbsp;<u><a href=\"http://www.katakrak.net/\" rel=\"noopener noreferrer\" target=\"_blank\">Katakrak</a></u>&nbsp;de Iru&ntilde;a,&nbsp;<u><a href=\"http://www.lapanterarossa.net/\" rel=\"noopener noreferrer\" target=\"_blank\">La Pantera Rosa</a></u>&nbsp;de Zaragoza,&nbsp;<u><a href=\"http://ateneucandela.info/node/88\" rel=\"noopener noreferrer\" target=\"_blank\">Synusia</a></u>&nbsp;de Terrasa y&nbsp;<u><a href=\"http://www.nodo50.org/lafuga/\" rel=\"noopener noreferrer\" target=\"_blank\">La Fuga&nbsp;</a></u>en Sevilla.</p>','https://www.facebook.com/traficantes.desuenos/',NULL,10,'Librearía asociativa.','https://t.me/Traficantes_Ed','https://twitter.com/traficantes2010','http://www.traficantes.net','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'','Calle Duque de Alba 13'),(322,'local',0,40.416887,-3.703549,'','',1999,NULL,'Transformando','Transformando',2,3,'Consultoría social, formación y asesoría en: evaluación, estudios, organización, calidad, etc. Proyectos de emprendimiento, social o inclusivo.',NULL,NULL,0,'Consultoría social, formación y asesoría en: evaluación, estudios, organización, calidad, etc. Proyectos de emprendimiento, social o inclusivo.',NULL,NULL,'http://www.transformando.org','','',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,'C/ Duque Fernán Núñez, 2, 1º'),(323,'estatal',0,37.9999588228522,-4.45754170417786,'','',2003,'','Transformando Sociedad Cooperativa Andaluza','Transformando Sociedad Cooperativa Andaluza',2,3,'<p>Fabricaci&oacute;n, Importaci&oacute;n y Comercializaci&oacute;n de prod