ación gráfica y desarrollo web. Nuestras señas de identidad: colaborar, transformar y compartir.',NULL,'https://twitter.com/freepresscoop','http://www.freepress.coop','','',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,'Paseo de las Acacias 3. 1º'),(332,'local',0,40.416887,-3.703549,'','',1998,NULL,'punto&coma','punto&coma',2,3,'Elaboración de publicaciones: - diseño y maquetación - redacción y/o revisión de textos - ilustraciones',NULL,NULL,0,'Elaboración de publicaciones: - diseño y maquetación - redacción y/o revisión de textos - ilustraciones',NULL,NULL,'http://www.puntoycoma.org','','',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,'Joaquín María López, 25'),(333,'local',0,40.416887,-3.703549,'','',2000,NULL,'satt arquitectura slp','sAtt ecoarquitectura; SATÉLITE ARQUITECTURA S.L.P.',2,3,'Satt ecoarquitectura es una oficina de arquitectura dedicada a la investigación y desarrollo de proyectos, metodologías y sistemas de construcción basados en la ecología social y medioambiental. - See more at: http://www.satt.es/#sthash.pq2n2twJ.dpuf',NULL,NULL,0,'Satt ecoarquitectura es una oficina de arquitectura dedicada a la investigación y desarrollo de proyectos, metodologías y sistemas de construcción basados en la ecología social y medioambiental. - See more at: http://www.satt.es/#sthash.pq2n2twJ.dpuf',NULL,NULL,'http://www.satt.es','','',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,'c/Villanueva 35, 6º 2'),(334,'estatal',0,40.404588,-3.703618,'entities/f5880d32-b9dd-41c7-93a9-e6a9b0f9f096.jpg','',2003,'','Sepra Servicio de Prevención SCC','SePrA',4,3,'<p>Servicio de Prevenci&oacute;n de Riesgos Laborales (SPA) para empresas. Elaboraci&oacute;n de Planes de Formaci&oacute;n y Formaci&oacute;n espec&iacute;fica a trabajadores. Trabajos espec&iacute;ficos entorno a la PRL, como soporte a Servicios de Prevenci&oacute;n Propios o para empresas</p>','sepra.formatecsccl',NULL,20,'Servicio de Prevención de Riesgos Laborales (SPA) para empresas. Elaboración de Planes de Formación y Formación específica a trabajadores. Trabajos específicos entorno a la PRL, como soporte a Servicios de Prevención Propios o para empresas',NULL,'@seprascc','http://sepra.coop','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'','Paseo de las Acacias 3 1-A'),(335,'local',0,40.4826408728,-3.36609050632,'entities/ce4de2f9-17d7-4b44-8ac4-570efae64dcb.jpg','',2015,NULL,'Asociación la Ínsula Colaboractiva','Ínsula Coworking',5,2,'<p>La &Iacute;nsula es un&nbsp;<strong>espacio de coworking</strong>&nbsp;en el centro de Alcal&aacute; de Henares.</p>\r\n\r\n<p>Es un lugar ideal para trabajadores free-lance &nbsp;y para los que trabajen a distancia con su empresa.&nbsp;Nos gustar&iacute;a que la &Iacute;nsula se llenase de &nbsp;personas convencidas de que<strong>&nbsp;otro mundo es posible</strong>, abiertas y con esp&iacute;ritu emprendedor.</p>\r\n\r\n<p>Ofrecemos un espacio donde poder desarrollar nuestra labor profesional, sin las distracciones que conlleva el trabajar en casa. Supone, adem&aacute;s, un claro enriquecimiento personal, por las relaciones que se generan con la comunidad coworking que se convierte, &nbsp;en una estupenda red de apoyo profesional.</p>\r\n\r\n<p>Queremos impulsar la&nbsp;<strong>creaci&oacute;n de una comunidad emprendedora colaborativa</strong>&nbsp;y ayudar a&nbsp;<strong>tejer redes</strong>&nbsp;de cooperaci&oacute;n entre proyectos&nbsp;y sinergias.</p>\r\n\r\n<p>Adem&aacute;s, nos gustar&iacute;a &nbsp;ser punto de referencia a la hora de buscar&nbsp;<strong>proyectos sociales</strong>&nbsp;en los que colaborar en nuestra ciudad.</p>\r\n\r\n<p>El espacio est&aacute;&nbsp;<strong>gestionado</strong>&nbsp;y&nbsp;<strong>dinamizado</strong>&nbsp;por la&nbsp;<strong>asociaci&oacute;n</strong>&nbsp;sin &aacute;nimo de lucro La &Iacute;nsula colaboractiva.</p>','https://www.facebook.com/InsulaCoworking',NULL,100,'La Ínsula es un espacio de coworking en el centro de Alcalá de Henares. Es un lugar ideal para trabajadores free-lance y para los que trabajen a distancia con su empresa.','https://t.me/insulacoworking','https://twitter.com/InsulaCoworking','https://insulacoworking.es/','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'Se admite pago en boniatos para los espacios de trabajo y el alquiler de sala de reuniones. No incluÃ­dos los talleres formativos.','Calle Mayor 26, 2ºB, Alcalá de Hernares'),(336,'local',0,40.4827969399,-3.36618304253,'entities/971cb9fa-ad32-4bbf-b9e0-aa34af14b60c.jpg','',2012,NULL,'Julio Berzal Carrascosa','Triskel Apps',3,5,'<p>Desarrollador freelance de aplicaciones m&oacute;viles para Android.</p>','https://www.facebook.com/triskel.apps/',NULL,100,'Desarrollador freelance de aplicaciones móviles para Android.','https://telegram.me/julio_berzal','https://twitter.com/triskelapps','http://www.triskelapps.com/','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'Ninguna','C/ Mayor 26, 2 B'),(337,'local',0,40.416887,-3.703549,'','',2019,'Nieves','Sin huella','Sin huella',0,0,'',NULL,NULL,0,'',NULL,NULL,NULL,'','',NULL,NULL,'',NULL,NULL,NULL,NULL,'',''),(339,'local',0,40.544103,-3.700117,'entities/1b6eb5be-2bd5-4d01-8fd6-2c34f4f298aa.jpg','',2013,NULL,'C/ Aldea del Fresno 9 1ºC 28045 Madrid','Asociación Ciclos Jelca',2,3,'<p>Alquiler, venta y reparaci&oacute;n de bicicletas. Tambi&eacute;n el&eacute;ctricas y de 2&ordf; Mano. Accesorios y repuestos de bicicletas. Talleres para aprender a montar en bici, circulaci&oacute;n, afianzamiento y seguridad; de mec&aacute;nica b&aacute;sica. Preparacion de flotas de alquiler, venta y/o mantenimiento. Bicletas y material decorativo, de anuncios o atrezzo clasico y/o moderno.</p>',NULL,NULL,100,'Alquiler, venta y reparación de bicicletas. También eléctricas y de 2ª Mano. Accesorios y repuestos de bicicletas. Talleres para aprender a montar en bici, circulación, afianzamiento y seguridad; de mecánica básica.',NULL,NULL,NULL,'','',NULL,NULL,'',NULL,NULL,NULL,NULL,'Tope 250â‚¬ por transacciÃ³n. Aplicable sobre la parte sin IVA','C/ Freud 5B'),(449,'estatal',1,40.7149642108,-3.9003610611,'entities/5a43e2da-c38f-4856-b20d-4ef07c83778c.jpg','entities/a161eeef-4167-44c6-a047-c9c50649ed36.jpg',2017,'INES GOROSPE','ASOCIACIÓN ORIGAMI, APRENDIZAJE Y DESARROLLO','ORIGAMI: APRENDIZAJE Y DESARROLLO',2,3,'<p><strong>Origami es una asociaci&oacute;n que pretende la transformaci&oacute;n social a trav&eacute;s del cambio educativo. </strong></p>\r\n\r\n<p>Creemos que la educaci&oacute;n y la innovaci&oacute;n son el mejor motor con el que transformar el mundo. A trav&eacute;s de nuestras actividades perseguimos un modelo de sociedad m&aacute;s responsable y respetuoso con las personas y con la naturaleza.</p>\r\n\r\n<p>Como proyecto de Econom&iacute;a Social y Solidaria, el modelo econ&oacute;mico que practicamos y promovemos tiene como finalidad el desarrollo y cuidado, colectivo e individual, de las personas, y como medio, la gesti&oacute;n eficiente de proyectos sostenibles desde el punto de vista ambiental, social y econ&oacute;mico. Todos los beneficios que se obtienen se destinan a los objetivos de la entidad, la formaci&oacute;n integral de las personas, el cuidado del medio ambiente y la transformaci&oacute;n social.</p>\r\n\r\n<p>En la Sierra de Guadarrama gestionamos el <strong>Centro de Innovaci&oacute;n Social Senbazuru</strong>, un proyecto integral que tiene tres partes fundamentales:</p>\r\n\r\n<p><strong>- Escuela internacional de Educaci&oacute;n Infantil, Primaria y Secundaria</strong>, donde se pretende una formaci&oacute;n integral, acompa&ntilde;ando el aprendizaje como un proceso natural, que surge de la curiosidad y la experiencia, del contacto con el medio ambiente y con la comunidad.</p>\r\n\r\n<p><strong>- Invernadero de Iniciativas Sociales</strong>, un espacio de trabajo compartido donde se alojan y colaboran empresas sociales, asociaciones u otras entidades ciudadanas.</p>\r\n\r\n<p><strong>- Centro de Innovaci&oacute;n y Formaci&oacute;n Socioambiental</strong>, donde partiendo de la investigaci&oacute;n y su aplicaci&oacute;n en el propio centro (agile learning, aprendizaje servicio, permacultura, etc.), se pretende dar a conocer y potenciar modos de vida respetuosos con la naturaleza y las personas.</p>\r\n\r\n<p>Las personas participantes en estas tres ramas conviven y colaboran en un <strong>espacio abierto a la participaci&oacute;n y las iniciativas de toda la comunidad</strong> (equipo docente, PAS, alumnado, familias, personas alojadas en el invernadero, vecindad&hellip;).</p>\r\n\r\n<p>La metodolog&iacute;a de la escuela, sumado a la colaboraci&oacute;n entre los sectores implicados y a la gesti&oacute;n horizontal del centro, pretende ser el caldo de cultivo de proyectos sociales a peque&ntilde;a y gran escala.</p>\r\n\r\n<p>El proyecto es llevado a cabo por un equipo multidisciplinar formado por personas profesionales de la educaci&oacute;n (docentes, pedagogas, etc.), arquitectas, trabajadoras sociales, ambient&oacute;logas, artistas, entre otras, todas ellos con una clara vocaci&oacute;n por mejorar el mundo en el que vivimos, y una sensibilidad especial hacia la infancia y la naturaleza.</p>\r\n\r\n<p>Tambi&eacute;n realizamos <strong>formaciones sobre temas de educaci&oacute;n y crianza respetuosas</strong>, <strong>adem&aacute;s de otras tem&aacute;ticas ambientales y sociales. </strong></p>\r\n\r\n<p>Organizamos <strong>cursos y viajes para conocer y nutrirnos de otros sistemas educativos</strong> (Finlandia, Estonia...), realizamos <strong>servicio de consultor&iacute;a pedag&oacute;gica</strong> (transformaci&oacute;n de aulas, redacci&oacute;n y seguimiento de proyectos...).</p>\r\n\r\n<p>Puedes informarte sobre estos y otros servicios en nuestra p&aacute;gina web y redes sociales.</p>\r\n\r\n<p><em>www.origamiforchange.org</em></p>','https://www.facebook.com/origamiforchange/','https://www.instagram.com/origamiforchange',100,'Origami es una Asociación que pretende la transformación social a través del cambio educativo.\r\nEl Centro de Innovación Social Senbazuru (Escuela internacional + Centro de Formación Socioambiental + Invernadero de Iniciativas Sociales) persigue un modelo de sociedad más responsable y respetuoso con las personas y con la naturaleza.',NULL,'https://twitter.com/origami4change','https://origamiforchange.org','El Centro de InnovaciÃ³n, la metodologÃ­a de la escuela, sumada a la colaboraciÃ³n entre los sectores implicados y a la gestiÃ³n horizontal del centro, pretende ser el caldo de cultivo de proyectos sociales a pequeÃ±a y gran escala.  \r\nCreemos que la educaciÃ³n y la innovaciÃ³n son el mejor motor con el que transformar el mundo. A travÃ©s de nuestras actividades perseguimos un modelo de sociedad mÃ¡s responsable y respetuoso con las personas y con la naturaleza.','Como proyecto de EconomÃ­a Social y Solidaria, el modelo econÃ³mico que practicamos y promovemos tiene como finalidad el desarrollo y cuidado, colectivo e individual, de las personas, y como medio, la gestiÃ³n eficiente de proyectos sostenibles desde el punto de vista ambiental, social y econÃ³mico. Todos los beneficios que se obtienen se destinan a los objetivos de la entidad, la formaciÃ³n integral de las personas, el cuidado del medio ambiente y la transformaciÃ³n social.',25000,14000,'REAS (Solicitada adhesiÃ³n)\r\nLUDUS\r\nAgile Learning Centers',NULL,3,1,2,'','Carretera M-608 Nº 11 (esq. c/ Peñas), 28413 El Boalo (Madrid)'),(460,'local',0,40.416887,-3.703549,'entities/1ec07cb4-9013-491b-b166-8bc7b5423319.jpg','',2019,'ZEBEN MARTÍN','NOVENTA GRADOS S. COOP. MAD.','CAFE DORÉ',0,0,'Bar de copas y espacio de expresión cultural','https://www.facebook.com/Caf%C3%A9-Dor%C3%A9-Lavapi%C3%A9s-1491973310835360/',NULL,0,'',NULL,NULL,NULL,'','',NULL,NULL,'',NULL,1,NULL,2,'','CALLE TORRECILLA DEL LEAL, 9'),(462,'estatal',1,40.4069280289,-3.69801521301,'entities/3da433b4-bac6-4f29-84b6-1ff3e656fbf3.jpg','',2019,'Almudena HernÃ¡ndez','Indetrein Publicidad, S.L','enRRRedando',2,0,'<p><strong>Comunicaci&oacute;n y marketing sostenible. </strong></p>\r\n\r\n<p>Dise&ntilde;o, estudio y planificaci&oacute;n de<strong> campa&ntilde;as de comunicaci&oacute;n en medios publicitarios</strong> teniendo en cuenta costes de producci&oacute;n, durabilidad, huella ecol&oacute;gica, etc.</p>\r\n\r\n<p><strong>Impresi&oacute;n y suministro de soportes de imagen corporativa</strong>, carteles, lonas, roll ups, banners, expositores, r&oacute;tulos fachadas, ...</p>\r\n\r\n<p>Dise&ntilde;o de imagen corporativa e impresi&oacute;n de<strong> papeler&iacute;a cualquier formato </strong>en materiales y con t&eacute;cnicas sostenibles.</p>\r\n\r\n<p><strong>Merchandising personalizado</strong>.</p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-size:9.0pt\">Escogemos productos con <strong>certificados o etiquetas ecol&oacute;gicas</strong> y que economicen <strong>energ&iacute;a y/o agua</strong> en su proceso de elaboraci&oacute;n.</span></span>&nbsp;</li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-size:9.0pt\">Utilizamos preferentemente materiales <strong>nacionales </strong>a fin de reducir la cantidad de <strong>empaquetado y el transporte</strong>.&nbsp;</span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-size:9.0pt\">En productos de usar y tirar, es imprescindible que los materiales sean <strong>biodegradables o renovables</strong>, <strong>100% reciclados y reciclables</strong>.</span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-size:9.0pt\"><strong>Art&iacute;culos artesanos</strong>.</span></span></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>',NULL,NULL,10,'Comunicación y marketing sostenible',NULL,'@enRRRedando','www.enrrredando.es','Generar redes de empresas y negocios y contactar con las ya existentes para difundir y transmitir conjuntamente intereses comunes. Realizar campaÃ±as fomentando la economÃ­a sostenible a travÃ©s campaÃ±as publicitarias, diseÃ±o grÃ¡fico, mechandising â€¦\r\n\r\nPotenciar el consumo de elementos y artÃ­culos promocionales fabricados con eco-materiales alternativos con producciÃ³n Ã©tica, teniendo en cuenta los costes de producciÃ³n, durabilidad, huella ecolÃ³gica, etc.\r\n\r\nCreaciÃ³n y diseÃ±o de artÃ­culos promocionales artesanos elaborados por colectivos de personas en riesgo de exclusiÃ³n social.','Se contactarÃ¡ con asociaciones de personas en riesgo de exclusiÃ³n social para la elaboraciÃ³n de merchandising artesanal.',26000,NULL,'',NULL,1,NULL,NULL,'','c/ Mallorca 4'),(498,'local',0,40.402581672617,-3.69338035583496,'','',2017,'Gustavo Zaragoza','Aplica Investigación y Traslación S. Coop. Mad','Aplica',0,3,'APLICA va de aplicar cambios en la sociedad para mejorarla, aplicando el conocimiento como palanca.\r\n\r\nEl equipo que lo formamos hemos trabajado durante años en la administración y en la academia, sintiendo con frecuencia que la sociedad del conocimiento no prioriza devolver el conocimiento a la sociedad. Desde nuestra experiencia, queremos contribuir a promover y facilitar ese retorno. Sentimos que, a menudo, las investigaciones en el campo de la salud y lo social se centran más en intereses académicos particulares y dinámicas aprehendidas, el factor de impacto, que en el bien colectivo, el impacto social. En APLICA apostamos por apoyar la transferencia del conocimiento en cualquiera de sus formas.\r\n\r\nCreemos que el dispendio del conocimiento es un despilfarro que no deberíamos permitirnos como sociedad. Por eso, pensamos que los esfuerzos colectivos y los recursos dedicados a la investigación deben materializarse en aportaciones rigurosas metodológicamente y relevantes en términos científicos, pero también que se correspondan con las necesidades reales de la sociedad. En APLICA queremos acompañar procesos de transformación del conocimiento en acción para el cambio, sea en la implementación de intervenciones, en la comunicación de resultados o en la realización de acciones para otorgarles incidencia política y social.\r\n\r\nConsideramos fundamental partir de las necesidades de la sociedad e incorporar sus perspectivas y voces en nuestras investigaciones, haciéndolas participativas y abiertas. Dar valor, por tanto, al conocimiento propio de las comunidades y las personas.\r\n\r\nNuestra filosofía de trabajo es “que todo el mundo gane”: cliente, APLICA y la sociedad.\r\n\r\nAPLICA va de dar aplicación social al conocimiento científico, aplicando pasión y rigor en lo que hacemos.','@aplicacoop',NULL,100,'APLICA somos una cooperativa de investigación social en salud y bienestar, formada por profesionales de la sociología, la politología y la salud pública, que ofrece servicios basados en el rigor metodológico y en la calidad científica, y que se identifica con principios y valores que repercuten en el bien social.\r\n\r\nNuestro compromiso es ayudar a la generación de conocimiento y facilitar su retorno a la sociedad para promover cambios que mejoren la vida de las comunidades y de las personas.',NULL,'@APLICAcoop','www.aplicacoop.com','Nuestro objetivo es devolver el conocimiento a la sociedad','Si Aplica tiene beneficios lo dedicarÃ¡ a la formaciÃ³n de las personas que trabajen en la cooperativa',13500,13500,'FIARE',NULL,NULL,NULL,3,'','Pza. Luca de Tena, 2 1ºD'),(506,'estatal',0,40.4200010988,-3.70589886967,'entities/bc31c9c4-bd5d-4630-b712-3951fd5b3e26.jpg','',2019,'Jessica Costilla','Implicate S.Coop.Mad.','Implícate',3,3,'<p>Impl&iacute;cate&nbsp;es una agencia de comunicaci&oacute;n fundada en el 2008 con la convicci&oacute;n de trabajar solo para causas sociales y que aporten a la construcci&oacute;n de un nuevo paradigma.</p>\r\n\r\n<p>En 2019 se al&iacute;a en cooperativa con La Comunal, de larga trayectoria en el Mercado Social de Madrid. Hacemos v&iacute;deos, webs, acciones de calle, gr&aacute;ficas, estrategias en redes sociales y lo que haga falta para provocar un cambio en las personas y en el planeta.</p>','https://www.facebook.com/implicateorg/','implicate_org',10,'Somos una agencia de publicidad y productora de contenidos que trabaja únicamente para proyectos y organizaciones con un fin social.',NULL,'https://twitter.com/Implicateorg','www.implicate.org','SensibilizaciÃ³n social y visibilizaciÃ³n de problemÃ¡ticas sociales.','TodavÃ­a no hemos tenido beneficios pero pensamos reinvertirlos para hacer sostenible la cooperativa y con buena calidad condiciones laborales',16000,16000,'Programa Mares de Madrid\r\nDocma',NULL,2,NULL,2,'','Plaza de Callao 1 P4 of 6'),(514,'local',0,40.3857660806001,-3.74567542880663,'','',1994,'','Centro Esp.Med y Odont. Codenta s.coop.mad','Codenta clínicasdentales',5,10,'<p>Cl&iacute;nicas Dentales de Especialidades</p>',NULL,NULL,10,'Clínicas Dentales de Especialidades',NULL,NULL,'http://www.codenta.es','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'','Guabairo, 19 Bajo'),(517,'estatal',0,40.1145112324,-5.38724899292,'entities/52bb0ca1-ca2c-4ed7-a928-fa60fc3b61ae.jpg','entities/b9db9b47-d585-4118-a68e-3456f0a45494.jpg',2017,'Alberto Ruiz Herranz','Avicultura de pastoreo S. L.','Granja agroecológica deCorral',2,3,'<p style=\"text-align:justify\">deCorral somos &Aacute;lvaro y Alberto, una peque&ntilde;a empresa familiar afincada en la Aldea Tudal de Villanueva de la Vera (C&aacute;ceres). Nos dedicamos a la ganader&iacute;a de pollo campero tradicional alimentado con piensos ecol&oacute;gicos certificados, y usamos procesos de certificaci&oacute;n social participativa para garantizar las condiciones de producci&oacute;n agroecol&oacute;gicas llevadas a cabo en nuestra finca. Tras a&ntilde;os de aprendizaje en otros proyectos, nace esta iniciativa agroecol&oacute;gica de autoempleo de la mano de un arquitecto t&eacute;cnico y un bi&oacute;logo, con la que pretendemos demostrar que es posible aunar la ganader&iacute;a av&iacute;cola campera tradicional con los est&aacute;ndares agroecol&oacute;gicos: la sostenibilidad ambiental, econ&oacute;mica y social. Con el objetivo de mantener la riqueza, la salud y la biodiversidad de nuestra finca, situada a los pies de Gredos, ideamos unos extensos parques de pastoreo para las aves, con un sistema de rotaci&oacute;n y descanso suficiente para generar el menor impacto sobre la pradera, una mejor integraci&oacute;n de las deyecciones de los animales en el terreno y una excelente recuperaci&oacute;n del pasto entre cada ciclo productivo. Adem&aacute;s, con el convencimiento de que al respetar la naturaleza se genera salud, nuestros animales solo consumen piensos ecol&oacute;gicos certificados, y completan su condici&oacute;n omn&iacute;vora con la ingesta diaria de pastos libres de agrot&oacute;xicos, con libertad de movimiento por extensas praderas, lo que genera una carne tierna y sabrosa, con una mejora significativa en la presencia de &aacute;cidos grasos insaturados como el Omega 3.</p>','https://www.facebook.com/aviculturadepastoreo',NULL,100,'La granja agroecológica deCorral es una iniciativa de producción de carne de pollo sobre praderas, ideada bajo la norma ecológica, pero certificada mediante procesos sociales participativos. Tenemos la convicción de que es posible producir de manera \"ecológica\" sin certificación oficial, con precios asequibles, de manera consciente y sin generar productos exclusivos. Transparencia, seriedad y agroecología.',NULL,NULL,'http://www.decorral.info','Desde la granja agroecolÃ³gica deCorral, intentamos poner de relieve que es posible producir bajo los criterios ambientales de la norma ecolÃ³gica, aun sin tener un certificado \"oficial\". Que es posible, de la misma manera, incluir aspectos sociales y econÃ³micos en el eje vertebral de un proyecto productivo viable. Se puede producir con sueldos dignos, hacer viable la vida rural y ofrecer productos agroecolÃ³gicos a precios asequibles que rompan con la tendencia hacia la exclusividad de ciertos productos con certificaciÃ³n ecolÃ³gica oficial. Por eso, llevamos 3 aÃ±os trabajando en un pequeÃ±o sello de certificaciÃ³n social participativa entre algunos productores y grupos de consumo, para que seamos nosotros, y no empresas o entidades pÃºblicas ajenas al dÃ­a a dÃ­a de nuestra producciÃ³n, los que certifiquen nuestro sistema y nuestros productos.\r\nA su vez, y como eje vertebral del proyecto, la reducciÃ³n de plÃ¡sticos de un solo uso es fundamental para nosotros. Por ello, solo vendemos unidades enteras, preparadas de distintas maneras, pero siempre envasado en una Ãºnica bolsa de plÃ¡stico reutilizable y reciclable. Con esta medida, quizÃ¡ \"menos estÃ©tica\" pero Ãºtil, hemos conseguido ahorrar cerca de 1000 kg de plÃ¡sticos al planeta en apenas aÃ±o y medio. Cambiar el modelo de consumir el pollo, atendiendo a algo tan importante como el envasado en plÃ¡stico, es un reto para nosotros.','',NULL,NULL,'Desde hace aÃ±os, formamos parte de la asamblea de El Puchero. Un grupo de productoras y grupos de consumo, que naciÃ³ del proyecto BAH!, pero que se abriÃ³ a mÃ¡s entidades hace aÃ±os, en el que trabajamos en un modelo de certificaciÃ³n social participativa desde hace unos aÃ±os. Un proyecto muy interesante que estÃ¡ a punto de ver la luz en forma de web, en el que hemos certificado unos cuantos proyectos productivos de nuestra asamblea y que resulta tremendamente Ãºtil para iniciativas como la nuestra, basadas en la norma ecolÃ³gica, pero sin certificado oficial.',NULL,NULL,NULL,NULL,'','Avicultura de pastoreo S. L. Apartado de Correos, 19. Villanueva de la Vera (Cáceres)'),(519,'local',1,40.4102672614,-3.70051234961,'entities/090f3bfd-f198-4ab6-9ba1-9977ff1b6ca1.jpg','entities/e2cda44b-e02e-4d77-8a9f-fa840726184a.jpg',2013,'Arturo MartÃ­nez','Asociación Bagaudas','Paskin Studio',3,3,'<p>Paskin Studio somos una imprenta cooperativa dedicada a la producci&oacute;n gr&aacute;fica, comunicaci&oacute;n social, impresi&oacute;n digital&nbsp; y soluciones inform&aacute;ticas orientada a proveer de nuestros servicios y conocimientos a los entornos de los movimientos sociales y la econom&iacute;a cooperativa, social y solidaria.</p>\r\n\r\n<p>Como cooperativa somos parte de un proyecto cooperativo mayor, el Ateneo Cooperativo Nosaltres, un espacio surgido de la Asamblea Popular del 15M fuertemente vinculado con el tejido asociativo del barrio de Lavapi&eacute;s. En el Ateneo convivimos distintos proyectos cooperativos y de autoempleo realizando una gesti&oacute;n colectiva tanto del espacio como de sus tareas reproductivas.</p>\r\n\r\n<p>Es por ello que nuestro objetivo va m&aacute;s all&aacute; de la producci&oacute;n de bienes y servicios, si no que entendemos nuestro trabajo como un medio de transformaci&oacute;n social. Siendo miembros del Mercado de Econom&iacute;a Social apostamos fuertemente por el fortalecimiento de las econom&iacute;as alternativas y, sobre todo, del tejido asociativo generado a su alrededor. No basta con hacer dinero al margen del circuito mercantil, necesitamos generar un modelo econ&oacute;mico viable y que tenga la capacidad de satisfacer las necesidades sociales.</p>',NULL,NULL,100,'Paskin Studio somos una imprenta cooperativa dedicada a la producción gráfica, comunicación social, impresión digital  y soluciones informáticas orientada a proveer de nuestros servicios y conocimientos a los entornos de los movimientos sociales y la economía cooperativa, social y solidaria.',NULL,'PaskinStudio','pasquines.info','No separamos nuestra tarea productiva de la reproductiva, nuestro proyecto estÃ¡ inserto dentro de un proyecto polÃ­tico mayor: el Ateneo Cooperativo Nosaltres, un espacio nacido de la Asamblea Popular del 15M de LavapiÃ©s. Ofrecemos un servicio necesario a las entidades y proyectos comprometidos con la transformaciÃ³n social.','A la reproducciÃ³n, mantenimiento y desarrollo del Ateneo Cooperativo Nosaltres.',5000,3200,'Mercado de EconomÃ­a Social, Ateneo Cooperativo Nosaltres, Faircoop, Comunidad de Intercambio La Canica',NULL,1,NULL,2,'','Ateneo Cooperativo Nosaltres - c/ Esperanza 5'),(559,'estatal',0,40.416887,-3.703549,'','',2000,'gabriel  marinero','AYUDA AL ANCIANO','AYUDA  AL  ANCIANO  SOBRE  RESIDENCIAS',0,0,'busqueda   gratuita  de  residencia  de  ancianos  segun  su  zona  salud  y  econmia . plazas libres desde  800 al mes ,  por  tlf  640 526 523  y  ayudaalanciano@hotmail.com',NULL,NULL,0,'busqueda   gratuita  de  residencia  de  ancianos  segun  su  zona  salud  y  econmia . plazas libres desde  800 al mes ,  por  tlf  640 526 523  y  ayudaalanciano@hotmail.com',NULL,NULL,'http://ayudaalanciano.org','soluciones    eticas   para  los mayores  que necesitan  residencia  de  ancianos  y  sus   familias','no   hay   beneficios',10000,3600,'',NULL,1,NULL,2,'','la   direccion  postal  no  se  hace nunca  publica ,  pues no  deseamos  visitas  de  atencion  al publico  solo  es  por   tlf  y  e mail'),(562,'estatal',0,0,0,'','',2019,'ALBERTO CAÑIZARES DELGADO','ALBERTO CAÑIZARES','CONTADO PIERDE',2,3,'Un espacio en el barrio  dedicado a la fotografía y sus múltiples vertientes; fotografía de estudio, analógica, cámaras minuteras, de autoconstrucción, estenopeicas, exposiciones y muestras, material fotosensible, laboratorio, venta de producto y renovación de cámaras, pedagogía y aprendizaje.\r\n\r\nEconomí­a independiente con respecto a los poderes públicos. Actuamos orientados por valores como la equidad, la solidaridad, la sostenibilidad, la participación, la inclusión y el compromiso con la comunidad, promoviendo el cambio social.\r\nUn nuevo espacio fotográfico en el centro de Madrid, que viene a sumar y a ofrecer un punto de encuentro para ir generando nuevas relaciones, dinámicas y proyectos.\r\n¿Quienes somos?\r\nContado Pierde está formado por  cuatro personas, \r\n Alberto Cañizares y las EcoCam, cámaras realizadas a partir de materiales reciclados.\r\n\r\nAlberto Omiste, artista conceptual y fotógrafo. \r\n\r\nPaloma Villoria, fotógrafa.\r\n\r\nLuis Hidalgo, fotógrafo.\r\n\r\nTodos estamos  dedicados a diversos ámbitos de la fotografía, tanto teórica como práctica, analógica y digital.\r\nContado Pierde te está esperando, ¡acércate y descubre este nuevo espacio fotográfico en Madrid!\r\n¿Donde estamos?\r\nEl proyecto Contado Pierde está situado en el puesto 40BIS de El Mercado de San Fernando.\r\nHorarios:\r\nEntre semana:\r\nDe 10:30H a 14h. Y de 17H. A 21H\r\nSábados y Domingos: \r\nDe 11:00H a 17H','https://www.facebook.com/contadopierde/',NULL,100,'Fotografía Social & Laboratorio de película',NULL,NULL,'https://www.instagram.com/contadopierde/','Siguiendo el principio de cooperación, queremos favorecer el trabajo conjunto y cooperativo en lugar de la competencia, dentro y fuera de nuestras organizaciones de la red de fotógrafos.','Contado Pierde es un espacio físico destinado a promover la fotografía en todos sus Ã¡mbitos (fotografía analógica y digital) y también en cuanto a su contenido (fotografí­a social, conceptual, de retrato, experimental, etc).\r\nSomos un equipo de personas dedicadas a generar y fortalecer una comunidad en torno a la fotografí­a en la que todos podamos colaborar y acceder de forma sencilla a la obra de los demás, difundirla y compartirla.\r\n\r\n¿CÓMO FUNCIONAMOS?\r\n\r\nTodos trabajamos la misma cantidad de horas, empleando el mismo esfuerzo y cuidando por mantener los logros conseguidos por los demás.\r\nNos regimos por las bases de la economí­a social, en la que el objetivo es el beneficio común y no el lucro.',NULL,NULL,'',0,1,NULL,3,'','Calle embajadores 41\r\n28012 Madrid'),(564,'local',0,40.416887,-3.703549,'entities/b2c6a758-571e-4182-8681-e57b04b508e3.jpg','',2019,'Mila','Milagros Baltasar','Formación Personal',2,3,'- Psicoterapía individual y de grupo para adultxs y adolescentes.\r\n- Talleres de desarrollo de habilidades personales, sociales y grupales.\r\n- Facilitación de los procesos de los grupos.\r\n\r\nEl enfoque es humanista e integrador. Busco que la persona se reconozca siendo parte de los grupos a los que pertenece ( familia, trabajo, ciudad, nación, mundo,...)y tambien se reconozca a si misma como un sistema compuesto por distintas partes (cuerpo, emoción, mente, ...). Para recoger todas esas partes las racionales, las intuitivas, las emmocionales, las corporales,...la metodología integra el saber cientifico que aporta la psicología con la sabiduría sobre lo grupal que aporta la Facilitación de grupos, y la vivencia e intuición que aporta la expresión artística y el trabajo con sueños. El sentido de este trabajo es la trans-\"formación personal\" y colectiva.',NULL,NULL,100,'',NULL,NULL,'http://www.formacionpersonal.org','','',NULL,NULL,'',NULL,NULL,NULL,NULL,'','Calle de la Alegria 16, local 2.'),(565,'local',1,40.4047058667,-3.70380878448,'entities/bc87631d-12d4-4395-a953-a2f86b62ea03.jpg','entities/ca1462b8-952d-4293-9c99-40af8637d56b.jpg',2014,'Santiago Alonso','Asociación Proyecto JAK Madrid','Proyecto JAK',0,0,'<p>JAK es un proyecto de banca &eacute;tica y democr&aacute;tica por una soberan&iacute;a financiera. Es una iniciativa de ciudadanos que se asocian para satisfacer mutuamente sus necesidades de financiaci&oacute;n por medio de una entidad de propiedad conjunta, controlada de forma democr&aacute;tica y asamblearia y gestionada con total transparencia y con una filosof&iacute;a basada en la solidaridad, la justicia y la ecolog&iacute;a.</p>','https://www.facebook.com/ProyectoJAK/',NULL,0,'Es una iniciativa formada por personas que se asocian para satisfacer sus necesidades de financiación, bajo un modelo de ahorro y ayudas reintegrables sin intereses (ARESI).',NULL,'https://twitter.com/proyectojak','http://www.proyectojak.es','Es una herramienta accesible de ahorro y prÃ©stamo para muchas consumidoras conscientes. Sirve para avivar el debate sobre el interÃ©s del dinero dentro del Mercado Social de Madrid.','La entidad no tiene beneficios, el destino de las cuotas de los asociados se destina al pago de servicios asociados al funcionamiento de la entidad: cuotas bancarias, pertenencia a otras entidades o participaciÃ³n en ferias.',0,0,'Somos una entidad socia de Fiare, socia de REFAS y colaboradora del Mercado Social de Madrid.',0,0,0,0,'','Paseo Acacias 3, 1º, CP: 28005. Madrid.(sede social, pero no hay oficina al público permanente)'),(566,'estatal',1,40.4272631223,-3.70097637177,'entities/47dba3e8-2c39-4520-9c5b-cd3c9fbebd72.jpg','entities/a4b6a5d8-b05c-4bff-8fb6-5e80fe373837.jpg',2017,'Miriam Barahona','Miriam Barahona','Sirem Wild',3,3,'<p>Sirem Wild une tres pasiones: arte, dise&ntilde;o y naturaleza.</p>\r\n\r\n<p>Somos una marca de ropa ecol&oacute;gica con dise&ntilde;os originales inspirados en la naturaleza. Los dise&ntilde;os parten de ilustraciones hechas a mano para no perder la esencia de la artista, empleando diferentes t&eacute;cnicas como el dibujo lineal de bol&iacute;grafo o la acuarela. El arte sale a la calle y lo puedes llevar contigo en tu ropa. Son piezas &uacute;nicas y exclusivas ya que se imprimen en ediciones limitadas.</p>\r\n\r\n<p>Somos sostenibles, las prendas se confeccionan con fibras naturales de algod&oacute;n org&aacute;nico, tencel lyocell o fibras provenientes de botellas de pl&aacute;stico recicladas. Apostamos por una moda sostenible y &eacute;tica, libre de explotaci&oacute;n (todas nuestras prendas se amparan bajo el sello Fair Wear Foundation de comercio justo), y consciente con la conservaci&oacute;n del medio ambiente. Una moda c&oacute;moda hecha a medida para las y los amantes de la naturaleza.</p>\r\n\r\n<p>Sirem Wild quiere cambiar los h&aacute;bitos de consumo en la moda para hacerla m&aacute;s sostenible, y potenciar un consumo m&aacute;s consciente.</p>\r\n\r\n<p>Con Sirem Wild te sientes especial, y ayudas a crear un mundo mejor</p>','https://www.facebook.com/siremwild','https://www.instagram.com/siremwild/',100,'Sirem Wild es ropa ecológica con diseños inspirados en la naturaleza en edición limitada, partiendo de dibujos hechos a mano.',NULL,'https://twitter.com/siremwild','http://siremwild.com/','Queremos ser una alternativa sostenible de consumo consciente en el sector de la moda, donde las prendas se producen de manera Ã©tica y se utilizan materiales orgÃ¡nicos que no daÃ±an el medioambiente.','Se reinvierten en mejorar la calidad de los productos.',NULL,NULL,'La TextilerÃ­a (colectivo de moda sostenible)\r\nAsociaciÃ³n Nacional Micorriza (trabajando por el medio ambiente)',NULL,NULL,NULL,NULL,'','Madrid'),(569,'estatal',0,40.5759072829313,-3.95026087760925,'entities/787775c5-088e-4633-b236-fbe4e206fb24.jpg','entities/e6121c8a-60c5-41fc-aecf-1a0f0156a85b.jpg',2019,'Sholeh Hejazi','Coworking La Solana','Sholeh Hejazi',0,0,'Espacio de coworking colaborativo','https://www.facebook.com/coworkinglasolana','https://www.instagram.com/coworkinglasolana/',0,'Espacio de coworking colaborativo',NULL,'https://twitter.com/coworkingsolana','https://coworkinglasolana.es/','Un espacio de aprendizaje colectivo en el sector empresarial','Apoyar nuevas empresas sociales',NULL,NULL,'SANNAS',NULL,NULL,NULL,NULL,'','Avda. Torrelodones15'),(573,'local',0,40.416887,-3.703549,'','',2000,'ANA ALFAGEME LANGDON','taliafarfalia','Ana Alfageme',2,3,'<p>Reciclaje textil como base para crear todo tipo de prendas, accesorios, bolsos, a partir de otras que la gente desecha en este ritmo loco de comprar y tirar. Mediante la deconstrucci&oacute;n y fusi&oacute;n de prendas minuciosamente seleccionadas, creamos nuevos patrones atrevidos y divertidos buscando siempre el m&iacute;nimo desperdicio. Dise&ntilde;os &uacute;nicos de mujer, ni&ntilde;@ y hombre. Por un consumo m&aacute;s responsable.</p>','@taliafarfalia','@taliafarfalia',100,'Reciclaje textil creativo. Por un consumo más responsable.',NULL,NULL,NULL,'','',NULL,NULL,'',NULL,NULL,NULL,NULL,'','C/ Embajadores, 41. Madrid 28012Mercado de San Fernando. Puesto 41Bis_El Punto del MES'),(588,'local',0,40.4825847701251,-3.36419820785522,'','',2019,'','aaaa','Zaloa',0,0,'',NULL,NULL,0,'',NULL,NULL,NULL,'','',NULL,NULL,'