LL,NULL,NULL,'','',NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL),(647,'local',1,40.4825847701251,-3.36419820785522,'entities/434fa113-e49a-4116-b9bb-6c0bed26793e.jpg','',2018,'Alicia Escobar Baron','Kuidamor','Kuidamor',0,0,'Somos una cooperativa de iniciativa social. Una empresa dirigida a la realización de servicios que mejoran la calidad de vida de las personas.\r\nLa actividad principal es la profesionalización del Sector de los Cuidados y la creación de empleo de calidad, mediante el desarrollo de servicios y actividades relacionadas con la atención, la promoción, rehabilitación y el cuidado de las personas así como otros servicios en hogares y comunidades generando empleo en condiciones dignas y sostenibles, aplicando de forma transversal el enfoque de género.','Kuidamor.org',NULL,0,'Ofrecemos cuidados y servicios profesionales de calidad.\r\nApostamos por un empleo digno y en condiciones',NULL,'@kuidamor','kuidamor.org','Empleo justo e igualitario con compromiso ético y formación','Se distribuyen entre las/los inscritos en la cooperativa',1,NULL,'',NULL,1,NULL,NULL,'','Avenida Dr Garcia tapia 88 1 C'),(653,'local',0,40.4600898944074,-3.67649815277866,'entities/67b8e11a-70be-420d-b77a-43f1a5c472b0.jpg','',2019,'ISRAEL MONTERO','ENERGY FLOW CONCEPT SOCIEDAD COOPERATIVA MADRILEÑA','ENERGY FLOW CONCEPT',0,0,'Clasificamos las energías, todas, que fluyen en un determinado contexto (vivienda, comunidad, edificio, empresa, organización) en sus tres niveles:\r\n\r\n1. Producción: La energía que compramos, la que producimos y la que recuperamos.\r\n\r\n	Ejemplos: Contratos de suministro, fotovoltaica, eólica, recuperadores de energía\r\n\r\n2. Transformación: Las tecnologías y sistemas que usamos para transformar, distribuir y controlar la energía.\r\n\r\nEjemplos: Calderas, tuberías, bombas de circulación de agua, sistemas de control,\r\nbaterías eléctricas, depósitos de agua, radiadores, sistemas de monitorización,\r\ntermostatos, repartidores de costes, etc…\r\n\r\n3. Demanda de energía: La cantidad de energía que demandan los edificios debido a sus condiciones de diseño, aislamiento y uso.\r\n	\r\n	Ejemplos: Ocupación, protocolos de uso y envolvente (fachadas, ventanas,\r\ncubiertas, terreno) \r\n\r\nOrdenados los diferentes “flujos” de energía de un caso particular, podemos determinar qué perspectivas, soluciones y oficios son prioritarios.\r\n\r\nEn otras palabras, la energía y las decisiones del consumidor entorno a ella no deben ser analizadas desde la perspectiva de un ingeniero, un arquitecto, una empresa de suministro de energía o un instalador, pues su especialidad y su negocio condicionan su perspectiva. \r\n\r\nEl consumidor va a encontrar rentabilidad en todas las perspectivas, pero solo cuando se concilian con su presupuesto, sus tiempos y su proyecto se sumarán unas a otras para ofrecer la mejor rentabilidad. \r\n\r\nLa más económica y ecológica de las soluciones es, por tanto, ordenar las perspectivas y actuar paso a paso.','https://m.facebook.com/profile.php?id=1472948363009119&ref=content_filter','energyflow_concept',0,'Creamos planes directores de energía triple balance englobando la gestión energética desde la compra/producción, pasando por la transformación hasta el consumo.',NULL,'@Energy_Flow_C','https://energyflowconcept.es/','Con nuestro proyecto queremos mostrar al usuario final que la energía es algo que ellos pueden dominar, que, lejos de serles ajeno, debe ser un elemento a tener en cuenta día a día desde el punto de vista de su conocimiento y comprensión. Una vez que el usuario adquiere poder sobre su energía y la gestiona más eficientemente se genera una reducción de su impacto en el medio ambiente que, siendo colateral, es muy potente.','Los beneficios de Energy Flow Concept se dedican a desarrollo de nuevas herramientas acercar al usuario la capacidad de conocer, gestionar y tomar decisiones sobre su propia energía, contribuyendo con ello al aumento de su fortaleza energética.',NULL,NULL,'Energy Flow Concept forma parte de Sannas, conglomerado de empresas triple balance por el cambio social.',NULL,NULL,NULL,3,'','PLAZA DEL PERÚ 5');
