INSERT INTO `simple_bpm_processstep` VALUES (1,'Bienvenida','La consumidora ha contactado con el MES interesada en formar parte. Se le informa y se le pide que rellene el formulario de inscripción','far fa-hand-paper',1,1,'#68ddf3'),(2,'Pago de cuota','Una vez se ha rellenado el cuestionario, se informa a la consumidora de la cuota correspondiente en base los criterios actuales, y se le plantea la posibilidad de fraccionamiento del pago de la cuota. Una vez se marque como completado este paso, la entidad pasará a estar en el estado de \"aprobada (pendiente de pago)\".','far fa-money-bill-alt',1,2,'#d1e644'),(3,'Alta en sistemas externos','Para finalizar el proceso de alta de socia, hay que dar de alta en las distintas listas y sistemas aparte de la herramienta de gestión.','fas fa-bullhorn',1,3,'#41c623'),(4,'Bienvenida','La entidad ha contactado con el MES interesada en formar parte. Se le informa y se le pide que rellene el formulario de inscripción','far fa-comment',2,1,'#60bdff'),(5,'Validar formulario de inscripción','La entidad a rellenado el formulario de inscripción. Hay que validarlo para ver que la información introducida es correcta y que la entidad está alineada con los principios de la ESS.','far fa-thumbs-up',2,2,'#3ad4aa'),(6,'Negociación de cuota y pago fraccionado','Se informa a la entidad de la cuota correspondiente en base los criterios actuales, y se le plantea la posibilidad de fraccionamiento del pago de la cuota. Una vez se marque como completado este paso, la entidad pasará a estar en el estado de \"aprobada (pendiente de pago)\".','far fa-money-bill-alt',2,3,'#9160d6'),(7,'Pago inicial','Se espera a que la entidad realice el pago inicial (del capital social y de la primera parte o el total de su cuota anual), por alguno de los métodos disponibles, ya sea por transferencia bancaria, domiciliación o pago con tarjeta.','far fa-credit-card',2,4,'#beed3f'),(8,'Alta en sistemas externos','Para finalizar el proceso de alta de socia, hay que dar de alta en las distintas listas y sistemas aparte de la herramienta de gestión.','fas fa-bullhorn',2,5,'#41c623'),(9,'Comunicación con la socia','Contacto previo con la socia para indagar sobre el motivo de la baja, hablar a ver si es definitivo, etc.','far fa-comment',3,1,'#71b4f3'),(10,'Saldar deudas','Comprobar saldos de etics de la socia. Si es una entidad (con posibilidad de endeudarse) y tiene un saldo negativo, debería saldar esa cantidad antes de proceder a la baja. Lo mismo para cualquier otro tipo de deuda que tenga contraída con el MES.','far fa-money-bill-alt',3,2,'#9e5fb9'),(11,'Baja en sistemas externos','Para finalizar el proceso de baja de socia, hay que dar de baja en las distintas listas y sistemas aparte de la herramienta de gestión.','fas fa-bullhorn',3,3,'#52dfa9');
